4	Ram Sketch	ram-sketch	<img src="http://dl.dropbox.com/u/6062/greg-org/ram.jpg" class="excerpt-img" />\r\n\r\nThis is just a quick doodle I was working on in my Moleskine last weekend. I blocked in the color for the horns with colored pencil and then abandoned it. I probably won&rsquo;t take this much further but may do as a finished piece in gouache/watercolor at a later date.	<div style="text-align: center;"><a href="http://www.flickr.com/photos/busyashell/5057148302/" title="Ram Sketch by greg.newman, on Flickr"><img alt="Ram Sketch" height="300" src="http://farm5.static.flickr.com/4087/5057148302_186c98a2dd.jpg" width="400" /></a></div>\r\n<div style="text-align: center;"><a href="http://www.flickr.com/photos/busyashell/5057148272/" title="Ram Ketch Blocking Color by greg.newman, on Flickr"><img alt="Ram Ketch Blocking Color" height="300" src="http://farm5.static.flickr.com/4108/5057148272_8baccb2d56.jpg" width="400" /></a></div>\r\n<p>This is just a quick doodle I was working on in my Moleskine last weekend. I blocked in the color for the horns with colored pencil and then abandoned it. I probably won't take this much further but may do as a finished piece in gouache/watercolor at a later date.</p>	textile	Drawing, sketch, pencil, ram, study, wildlife	Ram sketch.  A drawing study.	t	\N	\N	367	2010-10-06 09:46:25-04	2012-03-24 08:12:06.772793-04	Ram Sketch
11	Faces of the NFL Project - Drew Brees	faces-nfl-project-drew-brees	<img src="http://dl.dropbox.com/u/6062/greg-org/brees_dribbble.jpg" class="excerpt-img" />\r\n\r\nI already <a href="http://gregnewman.org/blog/text/13427725">mentioned</a> about the Faces of the NFL project and the secrecy associated with it.<br />This is painting number two in the series (of ten).   Drew Brees.   It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)	<p>I already <a href="http://gregnewman.org/blog/text/13427725">mentioned</a> about the Faces of the NFL project and the secrecy associated with it.<br />This is painting number two in the series (of ten).   Drew Brees.   It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)</p>\r\n<div style="align: center;"><a href="http://www.flickr.com/photos/busyashell/6145503790/" title="Face of the NFL #2 - Drew Brees by greg.newman, on Flickr"><img src="http://farm7.static.flickr.com/6153/6145503790_8edc5efd12.jpg" width="386" height="500" alt="Face of the NFL #2 - Drew Brees" /></a></div>	textile	caricature, illustration, painting, photoshop, art, portrait, NFL, Drew Brees	Caricature painting of Drew Brees; Faces of the NFL project.	t	\N	\N	316	2011-09-13 09:59:50-04	2012-03-24 08:46:22.121049-04	Faces of the NFL Project - Drew Brees
24	Speed Portraits	speed-portraits	<img src="http://dl.dropbox.com/u/6062/greg-org/speed-portraits.jpg" alt="Speed Portraits" class="excerpt-img" />\r\n\r\nEvery day I sketch, sometimes with pencil, sometimes with watercolors, sometimes digitally.  This morning I did a speed painting of my friend <a href="http://twitter.com/rogie">Rogie</a> which got me to thinking (sometimes dangerous)...	<div style="background: #eccdaa; color: #000; -moz-border-radius: 5px; -webkit-border-radius: 5px; font-size: 1.2em; padding: 10px 15px;">\r\nI've reduced the price of these to <b>$75</b> (half-off) which I'll cap off after x amount of orders and go back to the original fee.  I don't want to get too swamped with these (which was the main reason for the original price). <br /> <b><a href="http://shop.gregnewman.org/product/4-x4-speed-paint-portrait">Hurry and get your order in if you want added to the list</a></b>.\r\n</div>\r\n\r\nEvery day I sketch, sometimes with pencil, sometimes with watercolors, sometimes digitally.  This morning I did a speed painting of my friend <a href="http://twitter.com/rogie">Rogie</a> which got me to thinking (sometimes dangerous).  This particular digital watercolor painting took one hour.  It's not terribly detailed.  Would make for a nice profile pic around the social landscape.\r\n\r\n<div style="text-align: center;">\r\n<a href="http://shop.gregnewman.org/product/4-x4-speed-paint-portrait" title="order a speed painting"><img src="http://dl.dropbox.com/u/6062/greg-org/speed-portraits.jpg"  alt="Rogie King Speed Painting" /></a>\r\n</div>\r\n\r\nI get asked a lot to do portraits for people and since I do something like this daily I thought why not make this a service for those who care to have one done while I'm still getting my warmup routines.  An additional bonus [for me] is diversity in subjects.  A full detailed portrait is no less than big money and these would be affordable.\r\n\r\nWhat you'd get is a digital file of the speed painting and a five inch square Giclee print snail mailed to you to hang, throw darts at or use as a coaster.\r\n\r\nIf you're interested, shoot me an <a href="mailto:greg@gregnewman.org">email</a> or <a href="http://shop.gregnewman.org/product/4-x4-speed-paint-portrait" title="order a speed painting">just order one online</a>.	textile	speed painting, portrait, digital, watercolor, people, illustration, sketch	I get asked a lot to do portraits for people and since I do something like this daily I thought why not make this a service for those who care to have one done while I'm still getting my warmup routines.  A full detailed portrait is no less than bigger money.	t	\N	\N	741	2012-03-16 11:33:39-04	2012-03-24 02:06:22.290455-04	speed painting, portrait, digital, watercolor, people, illustration, sketch
19	Cheesehead at Macworld Expo	cheesehead-macworld-expo	<img src="http://dl.dropbox.com/u/6062/greg-org/AaronRodgers_macworld_cropped.jpg" class="excerpt-img" />I'm excited to announce that "Cheesehead", the painting of Aaron Rodgers was accepted into the Macworld | iWorld Digital Art Gallery at the 2012 Macworld Expo, January 26-28th.	<div style="text-align: center;"><img src="http://dl.dropbox.com/u/6062/greg-org/AaronRodgers_Macworld.jpg" /></div>\r\n\r\nI'm excited to announce that "Cheesehead", my painting of Aaron Rodgers, was accepted into the Macworld | iWorld Digital Art Gallery at the 2012 Macworld Expo, January 26-28th.  I entered three pieces, this seemed to be the winner with the selection committee.\r\n\r\n"You can still get prints of Cheesehead in the shop":http://shop.gregnewman.org/product/aaron-rodgers-print	textile	art, illustration, aaron rodgers, painter12, photoshop	I'm excited to announce that "Cheesehead", my painting of Aaron Rodgers, was accepted into the Macworld | iWorld Digital Art Gallery at the 2012 Macworld Expo.  I entered three pieces, this seemed to be the winner with the selection committee.	t	\N	\N	642	2011-12-16 12:23:00-05	2012-03-23 22:17:36.495203-04	Cheesehead at Macworld Expo
8	Self Portrait Caricature Painting	self-portrait-caricature-painting	<img src="http://dl.dropbox.com/u/6062/greg-org/greg_self_portrait_update.jpg" class="excerpt-img" />\r\n\r\nMost people know me as a "Devigner" (developer + designer) or "Hybrid" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. 	<p><a href="http://www.flickr.com/photos/busyashell/5615797327/" title="Self Portrait Caricature Painting by greg.newman, on Flickr"><img alt="Self Portrait Caricature Painting" height="390" src="http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg" width="465" /></a></p>\r\n<p>Most people know me as a "Devigner" (developer + designer) or "Hybrid" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven't really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href="http://advancedcaricature.co.uk/">Paul Moyse</a> offers and gave it a go.</p>\r\n<p>I've done a lot of portraits over the years and used to do wildlife art but I really never thought about caricature before. I found this a perfect fit for leaving this comfort zone of mine. One of the assignments from Paul was to do a self-portrait caricature. Once I got started sketching I asked my self why I wanted to do this again? This was really a grueling assignment. After literally about two dozen sketches I finally landed on a <a href="http://dribbble.com/shots/131350-Self-Portrait-Take-3-516">likeness I was happy with</a> and started painting. This piece was painted in Photoshop using standard brushes and took about 25 hours. Probably more due to the fact that I was overly critical painting myself for a change.</p>\r\n<p>Above is the finished piece which I'm now using as my profile pic on <a href="http://twitter.com/gregnewman">twitter</a> these days. If you're an artist and want to jump to a new level, I recommend Paul's course.</p>\r\n<p>I put together a time-lapse of the painting process on dribbble a few weeks ago that you can <a href="http://drbl.in/YKh">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn't have a replace image feature so you'll have to refresh to watch it again. Sorry!</p>	textile	caricature, illustration, painting, photoshop, art, portrait	Self portrait caricature painting.  Greg Newman.	t	\N	\N	371	2011-04-13 09:53:32-04	2012-03-24 08:51:57.813231-04	Self Portrait Caricature Painting
7	Ozan Value Study	ozan-value-study	<img src="http://dl.dropbox.com/u/6062/greg-org/ozan_vs_newman.jpg" class="excerpt-img" />\r\n\r\nValue study painted in Photoshop for a course I'm doing in the evenings with the excellent <a href="http://paulmoyse.com/teaching.htm">Paul Moyse</a>	<div style="text-align: center;"><img alt="Ozan Value Study" height="400" src="http://farm6.static.flickr.com/5060/5451969834_449dc1395a.jpg" width="284" /></div>\r\n\r\nValue study painted in Photoshop for a course I'm doing in the evenings with the excellent <a href="http://paulmoyse.com/teaching.htm">Paul Moyse</a>\r\n\r\n<a href="http://www.flickr.com/photos/busyashell/5451969834/" title="Ozan Value Study by greg.newman, on Flickr">View on flickr</a><br />Also on <a href="http://drbl.in/QZd">Dribbble</a>	textile	caricature, illustration, painting, photoshop, art, portrait	Caricature value study done in photoshop	t	\N	\N	760	2011-02-16 09:51:53-05	2012-03-24 07:07:36.400227-04	Ozan Value Study
22	Tim's Thoughts	tims-thoughts	<img src="http://dl.dropbox.com/u/6062/greg-org/jack_sally_tim_dribbble.jpg" class="excerpt-img" />\r\nI'm a huge fan of Nightmare. I have a boatload of collectors memorabilia in the studio and boxed away. Most never opened. I don't usually do fan art but after the nudge of a respected friend I took some time over the holidays to put my thoughts to paint.	I'm a huge fan of Nightmare. I have a boatload of collectors memorabilia in the studio and boxed away. Most never opened. I don't usually do fan art but after the nudge of a respected friend I took some time over the holidays to put my thoughts to paint.\r\n\r\n<div style="text-align: center;"><img src="http://dl.dropbox.com/u/6062/greg-org/burton_jack_sally.jpg" /></div>\r\n\r\nThis was painted in Painter12 and I forced myself to not zoom in as much as possible.  After all you can't do that traditionally.  I wanted to keep it very raw.  Strokes are very evident.  Below is a 50% zoom to show more of the brushes than the above image shows.\r\n\r\n<div style="text-align: center;"><img src="http://dl.dropbox.com/u/6062/greg-org/tim-sally-jack-zoomed.jpg" /></div>\r\n\r\nMy wife bought me "The Film, The Art, The Vision":http://amzn.to/tKHWw0 by Frank Thompson years ago and it was fun to revisit for references.  If you're a fan of the movie, this is a must have book in my opinion.\r\n\r\n"Prints can be grabbed in the shop":http://shop.gregnewman.org/product/tim-s-thoughts	textile	tim burton, jack, sally, nightmare before christmas, xmas, illustration, painting, painter12	I'm a huge fan of Nightmare. I have a boatload of collectors memorabilia in the studio and boxed away. Most never opened. I don't usually do fan art but after the nudge of a respected friend I took some time over the holidays to put my thoughts to paint.	t	\N	\N	346	2012-01-03 09:17:59-05	2012-03-23 16:11:11.055919-04	Tim's Thoughts
2	Rent to Own	rent-to-own	<img src="http://dl.dropbox.com/u/6062/greg-org/rent.jpg" class="excerpt-img" />\r\n\r\nSince relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.	<p><a href="http://www.flickr.com/photos/busyashell/4278304031/" title="Rent to Own by greg.newman, on Flickr"><img alt="Rent to Own" height="291" src="http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg" width="465" /></a></p>\r\n<p>Since relocating my family to Charlotte, North Carolina, in August of '09 I haven't had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>\r\n<p>We live in the outskirts of Charlotte where there's a comfortable mix of farms, countryside, history and hints of big city life. I've driven by this location many times since we've been here and have wanted to shoot it, specifically at sunset. The sunrises are spectacular here, and I'm a morning person, so why not get out and create some great images.</p>\r\n<p>This house has to be about a hundred years old or older judging from the size of the timbers framing the structure. I was able to see through missing floorboards and broken lattice work. Pieces of furniture still adorn the house, covered in dust and dirt. Old plastic bottles and toys littered the floor and yard. A dog bowl hinted at the one-time existence of pets.</p>\r\n<p>What struck me as humorous was a sign behind the property that read "Rent to Own" with a realtors phone number scribed in marker. The local fire department (if I have the property correct) has scheduled to burn the house down as a training exercise some time this winter or spring, so I'm glad I got the opportunity to record the house against a dramatic sunrise.</p>\r\n<p>This shot was taken with a Nikon D80 on a tripod. A Sigma 10-20mm superwide and 1 second exposure. This image is <span class="caps">NOT</span> <span class="caps">HDR</span>. I did however bump up the curves a tad to get the sky true to what I saw. Although I have my in-camera settings set for saturation I still can't get the D80 to record the colors truer to life. Or it could be the <span class="caps">RAW</span> conversion when I sync to Aperture.</p>	textile	photography, abandoned, structure, house, antique, old	Shot of an old abandoned 200 year old house in Wesley Chapel, North Carolina	t	\N	\N	205	2010-01-17 09:39:54-05	2012-03-24 09:20:46.078437-04	Rent to Own
23	Harley Davidson Vintage Series - 1946 EL Knucklehead	harley-davidson-vintage-series-1946-el-knucklehead	<img src="http://dl.dropbox.com/u/6062/greg-org/46_triptic_dribbble.jpg" class="excerpt-img" />\r\nI've spent the better part of the last two months working on the first painting for a series of vintage Harley Davidson motorcycles.  The '46 EL is the first out of the studio.  I did the original painting in the two-tone blue and cream vintage style and then repurposed...	<a href="http://shop.gregnewman.org/category/motorcycles" title="Vintage 1946 Harley Davidson and motorcycle painting and fine art prints in three colors, red, blue and cream, and black"><img src="http://dl.dropbox.com/u/6062/greg-org/46_triptic.jpg" alt="Harley Davidson Painting"  style="width: 500px;" /></a>\r\n\r\n<a href="http://shop.gregnewman.org/category/motorcycles" title="Harley Davidson and motorcycle painting and fine art prints">PRINTS AVAILABLE IN THE STORE</a>\r\n\r\nI've always had motorcycles in my blood and it's a natural fit for me to combine a passion with my art.  I started the first bike off with some exploratory sketches for value and anatomy of the components which were proofed by my good friend "Dino":http://sinistercustomcycles.com/ in Dauphin, PA for accuracy (if you live in PA, pay him a visit).  I know not all components are 100% period correct which is fine for the goal of this project.  I imagined how I would like to have a 46 if I could get my hands on one.\r\n\r\n<img src="http://dl.dropbox.com/u/6062/greg-org/hd-sketch.jpg" alt="Vintage 1946 Harley Davidson EL Sketch for the painting" />\r\n\r\nI've spent the better part of the last two months working on the first\r\npainting for a series of vintage Harley Davidson motorcycles.  The '46 EL\r\nis the first out of the studio.  I did the original painting in the two-tone\r\nblue and cream vintage style and then repurposed it with a red (more period correct)\r\nand also a black paint.\r\n\r\n<a href="http://shop.gregnewman.org/category/motorcycles" title="Vintage 1946 Harley Davidson and motorcycle painting and fine art prints">Prints are available in a variety of sizes and colors.  The largest is a beautiful\r\n11" x 17" Giclee print at a great introductory price.  We've also made available\r\n6" x 8" sketchcards with the printed model/year as individual colors or as a complete set.</a>\r\n\r\n<a href="http://shop.gregnewman.org/product/1946-harley-davidson-el-knucklehead-blue" title="Vintage 1946 Harley Davidson and motorcycle painting and fine art prints"><img src="http://dl.dropbox.com/u/6062/greg-org/46_el_knucklehead_blue.jpg" width="500px" alt="1946 Harley Davidson EL Knucklehead Painting" style="width: 500px;" /></a>\r\n\r\n<a href="http://shop.gregnewman.org/product/1946-harley-davidson-el-knucklehead-black" title="Vintage 1946 Harley Davidson and motorcycle painting and fine art prints"><img src="http://dl.dropbox.com/u/6062/greg-org/46_el_knucklehead_black.jpg" width="500px" alt="1946 Harley Davidson EL Knucklehead Painting" style="width: 500px;" /></a>\r\n\r\n<a href="http://shop.gregnewman.org/product/1946-harley-davidson-el-knucklehead-red" title="Vintage 1946 Harley Davidson and motorcycle painting and fine art prints"><img src="http://dl.dropbox.com/u/6062/greg-org/46_el_knucklehead_red.jpg" width="500px" alt="1946 Harley Davidson EL Knucklehead Painting" style="width: 500px;" /></a>\r\n\r\nI'm working on coffee mugs and other avenues for the artwork that will hopefully be released\r\nbefore April.\r\n\r\nNumber two in the series is already on the drawing board.  Follow the "facebook page":https://www.facebook.com/NewmanStudiosFineArt, subscribe to the rss feed or "newsletter":http://eepurl.com/jy1OP, or follow\r\non "twitter":http://twitter.com/gregnewman for more information about new releases.	textile	Harley Davidson, HD, Art, Motorcycle art, motorcycles, riding, Harley Art, vintage, bikes, bike art, biker art	1946 Harley Davidson model EL Knucklehead fine art paintings of motorcycles for bikers,, collectors and enthusiasts.	t	\N	\N	1399	2012-03-12 09:52:41-04	2012-03-24 10:46:40.372406-04	Harley Davidson Vintage Series - 1946 EL Knucklehead Painted and Illustration by Greg Newman
1	Painterly Portrait Processing	painterly-portrait-processing	<img src="http://dl.dropbox.com/u/6062/greg-org/brodey.jpg" class="excerpt-img" />\r\n\r\nSince posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it's <span class="caps">HDR</span>, some say it's got the Dave Hill feel to it.\r\n\r\nI will go through my recipe in detail. It's not a hard process. It's something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href="http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).	<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it's <span class="caps">HDR</span>, some say it's got the Dave Hill feel to it.</p>\r\n<div style="text-align: center;"><a href="http://www.flickr.com/photos/busyashell/1640623186/" title="Attitude Reprocessed by greg.newman, on Flickr"><img alt="Attitude Reprocessed" height="500" src="http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg" width="335" /></a></div>\r\n<p>I will go through my recipe in detail. It's not a hard process. It's something I've refined to work for me and over time, it's become second nature. I have even <a href="http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I'm great at lighting).</p>\r\n<p>Feel free to use the techniques but please don't republish this article or the images used in it.</p>\r\n<p><strong>Note:</strong> Click any image to see larger views.</p>\r\n<h3>Shot Details</h3>\r\n<p>For this shot, I setup under a bridge in the mid afternoon sun. Dialed down so I could overpower the sun coming in from the sides of the bridge and setup a SB-600 controlled via <span class="caps">CLS</span> to the left of the camera through a white umbrella.</p>\r\n<h3>Reduce Saturation of <span class="caps">RAW</span> Image</h3>\r\n<p>I don't like overly saturated images so the first thing I do is reduce the overall saturation. I usually go back in later and add in a little saturation for certain colors which we'll do in a later step.<a href="http://www.flickr.com/photos/74337277@N00/2437728674" title="View 'Post Article - Step 1' on Flickr.com"><img align="right" alt="Post Article - Step 1" border="0" src="http://static.flickr.com/3007/2437728674_4307325f2c_m.jpg" /></a></p>\r\n<h3>Vignette</h3>\r\n<p>For some images, vignettes work nicely. Especially this image because I think combined with the graffiti it adds a feel of darkness and grunge.</p>\r\n<h3>Increase Saturation in Blues</h3>\r\n<p>Now I'll add back in some saturation for just the blues which will help pull out Brodey's eyes and shirt. A little bit of blue exists in the graffiti which will make for some nice accents.</p>\r\n<h3>Add Definition</h3>\r\n<p><a href="http://www.flickr.com/photos/busyashell/2437729292/" title="Post Article by greg.newman, on Flickr"><img align="right" alt="Post Article" height="130" src="http://farm3.static.flickr.com/2249/2437729292_41875dfc42_o.jpg" width="281" /></a>Before I send the image over to Photoshop, Aperture 2.0 has a very nice definition tool which I use to prep the image with some detail. In version 1.5 (the original image) I used the edge sharpen tool.</p>\r\n<h3>Send to Photoshop</h3>\r\n<p>This is as far as I go in Aperture. With Aperture 2.1 you can do a lot of the following steps but I prefer photoshop for the heavier lifting.</p>\r\n<h3>Duplicate Base Layer and Add A S-Curve</h3>\r\n<p><a href="http://www.flickr.com/photos/busyashell/2437729732/" title="Post Article by greg.newman, on Flickr"><img align="right" alt="Post Article" height="100" src="http://farm3.static.flickr.com/2041/2437729732_4cdd7bd594_t.jpg" width="92" /></a><a href="http://www.flickr.com/photos/busyashell/2436909305/" title="Post Article - S Curve by greg.newman, on Flickr"><img align="right" alt="Post Article - S Curve" height="87" src="http://farm4.static.flickr.com/3099/2436909305_112ecfe788_t.jpg" width="100" /></a>Duplicate the base layer and go to Image &gt;&gt; Adjust &gt;&gt; Curves to add an S-Curve. I always click on options and choose "Enhance Monochromatic Contrast". It will effect the luminosity of the image this way instead of blowing your colors.</p>\r\n<h3>Shadow/Highlight</h3>\r\n<p><a href="http://www.flickr.com/photos/busyashell/2436909517/" title="Post Article - S/H by greg.newman, on Flickr"><img align="right" alt="Post Article - S/H" height="57" src="http://farm3.static.flickr.com/2137/2436909517_63a37f3d1c_t.jpg" width="100" /></a>With the duplicated layer still selected, go to Image &gt;&gt; Adjust &gt;&gt; Highlight/Shadow. Unless the highlights are blown, I typically only work with the shadows to lighten some of the dark areas. For this image my main concern is Brodey's hair, shirt and a little bit of the graffiti. I think this is a fantastic tool and one that is often overlooked in photoshop.</p>\r\n<h3>Duplicate Layer and Set To Soft Light</h3>\r\n<p>Duplicate this newly edited layer (your second layer) and set the blending mode to "Soft Light". Most of my images seem to work best with this blending mode. "Vivid Light" and a few others can be used as well so play around after the next step and see which you prefer for the image you're working on.</p>\r\n<h3>High Pass For Detail</h3>\r\n<p><a href="http://www.flickr.com/photos/74337277@N00/2437730498" title="View 'Post Article' on Flickr.com"><img align="right" alt="Post Article" border="0" src="http://static.flickr.com/3215/2437730498_aeebe195a6_m.jpg" /></a>I'm a fan of using High Pass for adding detail instead of unsharp mask. I think it does a much more painterly job when sharpening and can add some very nice effects to the image. Go to filters &gt;&gt; other &gt;&gt; High Pass and set the radius slider to about 9. This is highly dependent on the image, but for most I find this setting where I like it. The reason I set the blending mode prior to this step is so I can see the effect of the High Pass tool in real time. If you don't, the image will look embossed like the tiny preview in the dialog.</p>\r\n<h3>Dodge Hair, Eyes and Wrinkles</h3>\r\n<p><a href="http://www.flickr.com/photos/74337277@N00/2437731236" title="View 'Post Article' on Flickr.com"><img align="right" alt="Post Article" border="0" src="http://static.flickr.com/2203/2437731236_38afe434f3_m.jpg" /></a>I go back to layer two, the layer that I did the curves and highlight/shadow to and dodge (lighten) the midtones in the eyes, hair and shirt's wrinkles to pull out some more details. If you dodge the wrinkles in the clothing, it tends to give it a more three dimensional look.</p>\r\n<h3>Burn Shadows in Wrinkles</h3>\r\n<p>After I dodge, I usually go back and burn some of the wrinkles just to pull out more of that third dimension. Be careful not to pull the focus of the image into a area where you don't want it.</p>\r\n<h3>Duplicate Layer and Move to Top</h3>\r\n<p>When the dodge and burn is complete, duplicate the layer and move it to the top of the stack. We're going to soften the image a little. When using the highpass and dodge tools, the image can quickly become too harsh with detail in my taste. Some people may want to avoid this step but I typically do it on all portraits. It softens the skin too and helps hide blemishes.</p>\r\n<h3>Add Gaussian Blur</h3>\r\n<p><a href="http://www.flickr.com/photos/74337277@N00/2436911365" title="View 'Post Article' on Flickr.com"><img align="right" alt="Post Article" border="0" src="http://static.flickr.com/3206/2436911365_6ef91e5eee_m.jpg" /></a>Choose Filter &gt;&gt; Blur &gt;&gt; Guassian and set your radius slider to around 1.5, just enough to blur the image and hide some of the harsh details. Apply the filter and set the layers opacity to your liking. For this image I set it to about 80% opacity. Notice you still have more detail than the original image but not too harsh.</p>\r\n<h3>Step Fifteen Erase Eyes</h3>\r\n<p>Now that the image is softened, I want the original harsh detail from the earlier steps in the eyes to draw them out. I use the eraser tool with a soft edged brush to remove the gaussian layer at the eyes.</p>\r\n<p>When I'm satisfied with my edits and save the image which sends it back to Aperture for cataloging.</p>\r\n<div style="text-align: center;"><a href="http://www.flickr.com/photos/74337277@N00/2437732588" title="View 'Post Article' on Flickr.com"><img alt="Post Article" border="0" src="http://static.flickr.com/2233/2437732588_320a56291f.jpg" width="467" /></a></div>	textile	photography, post-processing, photoshop, aperture, painterly, effects, sharpening	Recipe for creating a painterly effect on your photographs.	t	\N	\N	407	2010-01-03 09:34:26-05	2012-03-24 04:27:10.60955-04	Painterly Portrait Processing
