12	Faces of the NFL Project - MJD	faces-nfl-project-mjd	<img src="http://dl.dropbox.com/u/6062/greg-org/mjd-dribbble.jpg" class="excerpt-img" />\r\n\r\nMaurice Jones Drew of the Jaguars is number three in this series.   I'm way into number four and delayed showing this one because I was working on the screencast that a bunch of people have requested I do. Special thanks to my brother, <a href="http://twitter.com/#!/tuckerjoenz" target="_blank">Tucker</a>, for his help in editing the screencast.	<div style="text-align: center;"><a href="http://www.flickr.com/photos/busyashell/6231865128/" title="Faces of the NFL #3 - MJD by greg.newman, on Flickr"><img src="http://farm7.static.flickr.com/6053/6231865128_8273364b82.jpg" width="409" height="500" alt="Faces of the NFL #3 - MJD" /></a></div>\r\n\r\nMaurice Jones Drew of the Jaguars is number three in this series.  I'm way into number four and delayed showing this one because I was working on the screencast that a bunch of people have requested I do.   Special thanks to my brother, <a href="http://twitter.com/#!/tuckerjoenz" target="_blank">Tucker</a>, for his help in editing the screencast.\r\n\r\n<iframe src="http://player.vimeo.com/video/30326174?byline=0&amp;portrait=0" width="600" height="443" frameborder="0" webkitallowfullscreen="" allowfullscreen=""></iframe>\r\n\r\n<a href="http://vimeo.com/30326174">Digital painting of Maurice Jones Drew</a> from <a href="http://vimeo.com/user1249615">Greg Newman</a> on <a href="http://vimeo.com">Vimeo</a>.\r\n\r\nThis is the first screencast I've ever done so I hope it's not complete garbage and helps a few people out. If you have questions, drop me a note in the comments.	textile	caricature, illustration, painting, photoshop, art, portrait, NFL, Maurice Jones Drew, screencast	Screencast and painting of Maurice Jones Drew (MJD); faces of the NFL project.	t	\N	\N	460	2011-10-10 10:01:48-04	2012-03-24 09:10:06.429923-04	Faces of the NFL Project - MJD
14	Faces of the NFL Project - Aaron Rodgers	faces-nfl-project-aaron-rodgers	<img src="http://dl.dropbox.com/u/6062/greg-org/rodgers_dribbble.jpg" class="excerpt-img" />\r\n\r\nContinuing with the NFL project, this is number five and my halfway point.  Aaron Rodgers.	Continuing with the NFL project, this is painting number five and my halfway point.  Aaron Rodgers.  I really pushed myself to keep the brush strokes visible in this painting, as you can see in the crop below (50% scale).\r\n\r\n\r\n<img src="http://dl.dropbox.com/u/6062/greg-org/rodgers_closeup.jpg" />'\r\n\r\n\r\n<div style="text-align: center;">\r\n<a href="http://www.flickr.com/photos/busyashell/6303633241/" title="Faces of the NFL #5 - Aaron Rodgers by greg.newman, on Flickr"><img src="http://farm7.static.flickr.com/6098/6303633241_c8d6c2eaf8_o.jpg" width="500" height="611" alt="Faces of the NFL #5 - Aaron Rodgers"></a></div>\r\n\r\n\r\nI'm painting these at approximately eight inches wide by ten inches tall at 300 dpi.  On this particular painting I did not allow myself to zoom in too often, which is evident in the jersey.  I don't know why, but I feel like I'm cheating when I zoom in.  After all, you can't do that in traditional painting.\r\n\r\nA lot of people have been asking what brushes I use and what opacity.  Right now I'm only using two brushes.  A #19 and #24 in photoshop with varying opacity.  I usually keep the flow around 24%.  For hair, I turn on shape dynamics on the #24 brush.  That's about it. Nothing fancy.	textile	caricature, illustration, painting, photoshop, art, portrait	Continuing with the NFL project, this is painting number five and my halfway point.  Aaron Rodgers. I really pushed myself to keep the brush strokes visible in this painting.	t	\N	\N	588	2011-11-01 18:31:17-04	2012-03-24 00:38:50.441787-04	Faces of the NFL Project - Aaron Rodgers
9	Bill Cosby	bill-cosby	<img src="http://dl.dropbox.com/u/6062/greg-org/cosby-dribbble.jpg" class="excerpt-img" />\r\n\r\nGo ahead.  Say it! PUDDING POPS!!\r\n\r\nIt's been a while since I've posted.  I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.	<p>Go ahead.  Say it! PUDDING POPS!!</p>\r\n<p><a href="http://www.flickr.com/photos/busyashell/5925578711/" title="Bill Cosby by greg.newman, on Flickr"><img src="http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg" width="500" height="339" alt="Bill Cosby" /></a></p>\r\n<p>It's been a while since I've posted.  I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p><p>To try and catch up.  I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4.  That will require a post of its own.</p><p>I'm in the process of setting up a society6 store as well and this <a href="http://society6.com/gregnewman" target="_self">print is available at small sizes</a>.</p>	textile	Bill Cosby, painting, portrait, caricature, photoshop	Photoshop painting of Bill Cosby.  Pudding Pops!!	t	\N	\N	262	2011-09-13 09:54:58-04	2012-03-24 09:28:26.40409-04	Bill Cosby
5	Chimp Study	chimp-study	<img src="http://dl.dropbox.com/u/6062/greg-org/chimp.jpg" class="excerpt-img" />\r\n\r\nI'm planning out a painting for my son of a chimpanzee. He's fascinated by monkeys. This is one of the studies from the sketchbook.	<div style="text-align: center;"><a href="http://www.flickr.com/photos/busyashell/5095959027/" title="Chimp Study by greg.newman, on Flickr"><img alt="Chimp Study" height="300" src="http://farm5.static.flickr.com/4124/5095959027_51bd4dc5ac.jpg" width="400" /></a></div>\r\n<p>I'm planning out a painting for my son of a chimpanzee. He's fascinated by monkeys. This is one of the studies from the sketchbook.</p>	textile	art, illustration, wildlife, pencil. drawing, sketch, chimp	Chimp study sketch	t	\N	\N	363	2010-10-19 09:48:36-04	2012-03-24 02:02:44.127586-04	Chimp Study
17	Juvenile in Flight	juvenile-flight	<img src="http://dl.dropbox.com/u/6062/greg-org/juvenile_in_flight_dribbble.jpg" class="excerpt-img" />\r\nThis is a painting done in Painter 12 and Photoshop as a personal project that I worked on over the Thanksgiving holiday.  I drug my feet on this for ages until my friend "Rogie":http://twitter.com/rogie gave me a virtual kick in the ass to get it finished.	This is a painting done in Painter 12 and Photoshop as a personal project that I worked on over the Thanksgiving holiday.  I drug my feet on this for ages until my friend "Rogie":http://twitter.com/rogie gave me a virtual kick in the ass to get it finished.  It was a blast to paint but also drove me a little bit insane for obvious reasons (the feathers).  I think the overall time was roughly thirty hours in this piece.\r\n\r\n<img src="http://dl.dropbox.com/u/6062/greg-org/juvenile_in_flight_500w.jpg" />\r\n\r\nThis painting is in the shop for those interested in owning a signed print.  "You can buy the print here":http://shop.gregnewman.org/product/juvenile-in-flight\r\n\r\nI have also put together a time-lapse of the painting.  It's not fancy.  I used my dropbox revisions to grab screen captures.  Enjoy!\r\n\r\n<iframe src="http://player.vimeo.com/video/32848155?byline=0&amp;portrait=0" width="500" height="331" frameborder="0" webkitAllowFullScreen mozallowfullscreen allowFullScreen></iframe><p><a href="http://vimeo.com/32848155">Time Lapse Painting Demo</a> from <a href="http://vimeo.com/gregnewman">Greg Newman</a> on <a href="http://vimeo.com">Vimeo</a>.</\r\n\r\n	textile	painting, illustration, art, eagle, painter12, photoshop, wildlife	"Juvenile in Flight" is a painting done in Painter 12 and Photoshop as a personal project that I worked on over the Thanksgiving holiday. 	t	\N	\N	431	2011-12-07 09:31:25-05	2012-03-24 05:46:28.733452-04	Juvenile in Flight
3	The Stork Lost One, An Adoption Reunion	stork-lost-one-adoption-reunion	<p>Friday (June 11th), I made a public announcement on <a href="http://twitter.com/gregnewman/status/15932515611">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it&rsquo;s still too long of a read!</p>\r\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there&rsquo;s a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>	<p>Friday (June 11th), I made a public announcement on <a href="http://twitter.com/gregnewman/status/15932515611">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it's still too long of a read!</p>\r\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there's a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>\r\n<h3>The search</h3>\r\n<p>My mother was sixteen years old when I was born. My father twenty. Anyone can understand the circumstance that led to my adoption. That is obvious. In my mind's eye I figured the two of them probably went their separate ways. I would find my biological mother, ask her questions, and maybe then be able to find my biological father as well. In no way was I prepared for the reality of it. A more perfect set of circumstances.</p>\r\n<p>I've been searching for my birth-mother for approximately twenty years but really got serious about it after my son was born almost fifteen years ago. Twelve years ago my wife spent days or weeks, filling out adoption registries on the internet. They went unanswered. We hired a private investigator who specialized in adoption searches seven years ago. They worked on the case for one year and turned up nothing. I had very little to go on. I had no names and only non-identifying information. The adoptions in Wyoming are closed requiring court orders for information. Something that requires a medical condition. The hospital and young mothers home in Denver, where I was born, is gone. I was informed all records were destroyed, possibly in a fire. We shelved the search about five years ago and while it went unforgotten we had to wait for something to change in adoption laws, or a slight chance someone would see the records that were filed on adoption registries online.</p>\r\n<h3>The contact</h3>\r\n<p>On Monday, May 24th around 9:00am I got a call from <a href="http://adoptiondatabase.org/">AdoptionDatabase.org</a>. I had often received emails from the registries but never a call. The caller told me they had been contacted by a gentleman who said he was 99 percent sure I was his brother. She told me they were marking the record as "found" and I was to contact his person and do a <span class="caps">DNA</span> test. As far as they were concerned that record was closed.</p>\r\n<p>They gave me my potential brother's name, phone number and email address. I recognized the area code as Baltimore so my wife and I got on Facebook and quickly filtered him out. I think I shat myself at that point. My wife instantly said he looked like me. He had eerily parallel interests, talents and career as me. And even drove a Jeep (I'm a Jeep man).<br />I reached out by phone first with no luck. I chickened out with the voicemail so I sent off an email. I don't think fifteen minutes passed before my phone rang.</p>\r\n<p>When he called, he told me we had a sister (Wow!!) and we discussed the non-identifying information I had, confirming it matched.</p>\r\n<p>Over the first week the three of us compared pictures, descriptions of ourselves and were sure there was only about a half a percent chance any <span class="caps">DNA</span> test would be negative. My potential brother and I ordered the tests kits and sent them in Friday, June 4th. We spent all this week spamming the sites forms to get the results back. They were posted yesterday morning; a perfect match.</p>\r\n<p>Now when I said earlier that there was a "more perfect set of circumstances" I was referring to my new brother and sister. They are both one-hundred percent biological siblings. Both of my birth-parents stayed together and had two more children. While my birth-parents are both deceased and I cannot get to know them personally, I think a better scenario is that I get to know my little sister and little brother and in turn get to know my parents. My little sister has two kids and my brother has three. Instant uncle! In addition I've got an Aunt in California with two daughters who also have children. Our family just got huge.</p>\r\n<p>For those interested, my Brother, Tucker Jones, is on twitter: http://twitter.com/urbanrunic. He's a talented designer, artist, photographer, web dev and film maker. Friend him up! My Sister, Trista, is living in Chicago and also is a talented artist (though she won't admit it). I won't get into personal details out of respect for their privacy.</p>\r\n<h3>Going Forward</h3>\r\n<p>I don't know where this will go. We're just going to take it day by day and get to know each other. We are planning a reunion this summer and it can't happen soon enough! I can say that in my opinion the three of us clicked instantly. I feel very comfortable talking to both of them as if I had never been separated and I thank both of them for their openness.</p>\r\n<h3>Thoughts</h3>\r\n<p>I definitely have to thank my wife, Jodi. Without her, my information probably wouldn't be on so many sites available for my siblings to find me. And I have to thank Tucker's girlfriend Kristin for actually using her search powers to find the record. These two ladies are the key to this reunion!</p>\r\n<p>To adoptive parents. Please try to put yourself in your children's shoes. No matter what you do or say you must support your child if he/she wants to find their biological family. A deep desire to find them is something that many adoptees feel and being non-supportive is of no help and will only drive a wedge between you. Give them all the information you have and encourage that reunion. It doesn't change the fact that you have raised them as your own. To an adoptee it feels like you have started a book from the middle. While you may know how it ends, you never know why.</p>\r\n<p>My adopted Father has been nothing but supportive and is sharing in our joy.</p>\r\n<p>Adoptees' don't give up your search, and keep a very open mind. I do understand that not all reunions are happy, but there are just as many that are.</p>	textile	adoption, reunion	Adoption reunion story	t	\N	\N	239	2010-06-11 09:42:35-04	2012-03-23 16:11:46.386819-04	The Stork Lost One, An Adoption Reunion
10	Faces of the NFL Project - Tom Brady	faces-nfl-project-tom-brady	<img src="http://dl.dropbox.com/u/6062/greg-org/brady_dribbble.jpg" class="excerpt-img" />\r\n\r\nI'm working on a client project and can't say too much about it for obvious reasons.   I can however show some progress as I go along.   This is number one in the series; Tom Brady.  It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)	<p>I'm working on a client project and can't say too much about it for obvious reasons. I can however show some progress as I go along.   I will update everyone when the time comes on the awesome nature of the project though.   Keep posted!</p>\r\n<p>This is number one in the series; Tom Brady.   It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)</p>\r\n<div style="align: center;"><a href="http://www.flickr.com/photos/busyashell/6145503574/" title="Face of the NFL #1 - Tom Brady by greg.newman, on Flickr"><img src="http://farm7.static.flickr.com/6077/6145503574_24016d65fe.jpg" width="409" height="500" alt="Face of the NFL #1 - Tom Brady" /></a></div>	textile	caricature, illustration, painting, photoshop, art, portrait, tom brady, NFL	Caricature painting of Tom Brady.  Faces of the NFL project.	t	\N	\N	437	2011-09-13 09:58:06-04	2012-03-24 01:14:02.321335-04	Faces of the NFL Project - Tom Brady
