4	4	1	15	json	[{"pk": 1, "model": "blog.entry", "fields": {"body": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it&rsquo;s <span class=\\"caps\\">HDR</span>, some say it&rsquo;s got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It&rsquo;s not a hard process. It&rsquo;s something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).</p>\\r\\n<p>Feel free to use the techniques but please don&rsquo;t republish this article or the images used in it.</p>\\r\\n<p><strong>Note:</strong> Click any image to see larger views.</p>\\r\\n<h3>Shot Details</h3>\\r\\n<p>For this shot, I setup under a bridge in the mid afternoon sun. Dialed down so I could overpower the sun coming in from the sides of the bridge and setup a SB-600 controlled via <span class=\\"caps\\">CLS</span> to the left of the camera through a white umbrella.</p>\\r\\n<h3>Reduce Saturation of <span class=\\"caps\\">RAW</span> Image</h3>\\r\\n<p>I don&rsquo;t like overly saturated images so the first thing I do is reduce the overall saturation. I usually go back in later and add in a little saturation for certain colors which we&rsquo;ll do in a later step.<a href=\\"http://www.flickr.com/photos/74337277@N00/2437728674\\" title=\\"View 'Post Article - Step 1' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article - Step 1\\" border=\\"0\\" src=\\"http://static.flickr.com/3007/2437728674_4307325f2c_m.jpg\\" /></a></p>\\r\\n<h3>Vignette</h3>\\r\\n<p>For some images, vignettes work nicely. Especially this image because I think combined with the graffiti it adds a feel of darkness and grunge.</p>\\r\\n<h3>Increase Saturation in Blues</h3>\\r\\n<p>Now I&rsquo;ll add back in some saturation for just the blues which will help pull out Brodey&rsquo;s eyes and shirt. A little bit of blue exists in the graffiti which will make for some nice accents.</p>\\r\\n<h3>Add Definition</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729292/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"130\\" src=\\"http://farm3.static.flickr.com/2249/2437729292_41875dfc42_o.jpg\\" width=\\"281\\" /></a>Before I send the image over to Photoshop, Aperture 2.0 has a very nice definition tool which I use to prep the image with some detail. In version 1.5 (the original image) I used the edge sharpen tool.</p>\\r\\n<h3>Send to Photoshop</h3>\\r\\n<p>This is as far as I go in Aperture. With Aperture 2.1 you can do a lot of the following steps but I prefer photoshop for the heavier lifting.</p>\\r\\n<h3>Duplicate Base Layer and Add A S-Curve</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729732/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"100\\" src=\\"http://farm3.static.flickr.com/2041/2437729732_4cdd7bd594_t.jpg\\" width=\\"92\\" /></a><a href=\\"http://www.flickr.com/photos/busyashell/2436909305/\\" title=\\"Post Article - S Curve by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S Curve\\" height=\\"87\\" src=\\"http://farm4.static.flickr.com/3099/2436909305_112ecfe788_t.jpg\\" width=\\"100\\" /></a>Duplicate the base layer and go to Image &gt;&gt; Adjust &gt;&gt; Curves to add an S-Curve. I always click on options and choose &ldquo;Enhance Monochromatic Contrast&rdquo;. It will effect the luminosity of the image this way instead of blowing your colors.</p>\\r\\n<h3>Shadow/Highlight</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2436909517/\\" title=\\"Post Article - S/H by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S/H\\" height=\\"57\\" src=\\"http://farm3.static.flickr.com/2137/2436909517_63a37f3d1c_t.jpg\\" width=\\"100\\" /></a>With the duplicated layer still selected, go to Image &gt;&gt; Adjust &gt;&gt; Highlight/Shadow. Unless the highlights are blown, I typically only work with the shadows to lighten some of the dark areas. For this image my main concern is Brodey&rsquo;s hair, shirt and a little bit of the graffiti. I think this is a fantastic tool and one that is often overlooked in photoshop.</p>\\r\\n<h3>Duplicate Layer and Set To Soft Light</h3>\\r\\n<p>Duplicate this newly edited layer (your second layer) and set the blending mode to &ldquo;Soft Light&rdquo;. Most of my images seem to work best with this blending mode. &ldquo;Vivid Light&rdquo; and a few others can be used as well so play around after the next step and see which you prefer for the image you&rsquo;re working on.</p>\\r\\n<h3>High Pass For Detail</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437730498\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3215/2437730498_aeebe195a6_m.jpg\\" /></a>I&rsquo;m a fan of using High Pass for adding detail instead of unsharp mask. I think it does a much more painterly job when sharpening and can add some very nice effects to the image. Go to filters &gt;&gt; other &gt;&gt; High Pass and set the radius slider to about 9. This is highly dependent on the image, but for most I find this setting where I like it. The reason I set the blending mode prior to this step is so I can see the effect of the High Pass tool in real time. If you don&rsquo;t, the image will look embossed like the tiny preview in the dialog.</p>\\r\\n<h3>Dodge Hair, Eyes and Wrinkles</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437731236\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2203/2437731236_38afe434f3_m.jpg\\" /></a>I go back to layer two, the layer that I did the curves and highlight/shadow to and dodge (lighten) the midtones in the eyes, hair and shirt&rsquo;s wrinkles to pull out some more details. If you dodge the wrinkles in the clothing, it tends to give it a more three dimensional look.</p>\\r\\n<h3>Burn Shadows in Wrinkles</h3>\\r\\n<p>After I dodge, I usually go back and burn some of the wrinkles just to pull out more of that third dimension. Be careful not to pull the focus of the image into a area where you don&rsquo;t want it.</p>\\r\\n<h3>Duplicate Layer and Move to Top</h3>\\r\\n<p>When the dodge and burn is complete, duplicate the layer and move it to the top of the stack. We&rsquo;re going to soften the image a little. When using the highpass and dodge tools, the image can quickly become too harsh with detail in my taste. Some people may want to avoid this step but I typically do it on all portraits. It softens the skin too and helps hide blemishes.</p>\\r\\n<h3>Add Gaussian Blur</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2436911365\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3206/2436911365_6ef91e5eee_m.jpg\\" /></a>Choose Filter &gt;&gt; Blur &gt;&gt; Guassian and set your radius slider to around 1.5, just enough to blur the image and hide some of the harsh details. Apply the filter and set the layers opacity to your liking. For this image I set it to about 80% opacity. Notice you still have more detail than the original image but not too harsh.</p>\\r\\n<h3>Step Fifteen Erase Eyes</h3>\\r\\n<p>Now that the image is softened, I want the original harsh detail from the earlier steps in the eyes to draw them out. I use the eraser tool with a soft edged brush to remove the gaussian layer at the eyes.</p>\\r\\n<p>When I&rsquo;m satisfied with my edits and save the image which sends it back to Aperture for cataloging.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/74337277@N00/2437732588\\" title=\\"View 'Post Article' on Flickr.com\\"><img alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2233/2437732588_320a56291f.jpg\\" width=\\"467\\" /></a></div>", "category": [], "read_count": 0, "description": "Recipe for creating a painterly effect on your photographs.", "title": "Painterly Portrait Processing", "related_content": [], "markup": "textile", "tags": "photography, photoshop, aperture", "excerpt": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it&rsquo;s <span class=\\"caps\\">HDR</span>, some say it&rsquo;s got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It&rsquo;s not a hard process. It&rsquo;s something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).</p>", "publish_on": null, "blog": [], "created_on": "2010-01-03 08:34:26", "published": true, "keywords": "photography, post-processing, photoshop, aperture, painterly, effects, sharpening", "updated_on": "2011-10-15 08:36:34", "expire_on": null, "slug": "painterly-portrait-processing"}}]	Painterly Portrait Processing	0	1
5	5	2	15	json	[{"pk": 2, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>\\r\\n<p>We live in the outskirts of Charlotte where there&rsquo;s a comfortable mix of farms, countryside, history and hints of big city life. I&rsquo;ve driven by this location many times since we&rsquo;ve been here and have wanted to shoot it, specifically at sunset. The sunrises are spectacular here, and I&rsquo;m a morning person, so why not get out and create some great images.</p>\\r\\n<p>This house has to be about a hundred years old or older judging from the size of the timbers framing the structure. I was able to see through missing floorboards and broken lattice work. Pieces of furniture still adorn the house, covered in dust and dirt. Old plastic bottles and toys littered the floor and yard. A dog bowl hinted at the one-time existence of pets.</p>\\r\\n<p>What struck me as humorous was a sign behind the property that read &ldquo;Rent to Own&rdquo; with a realtors phone number scribed in marker. The local fire department (if I have the property correct) has scheduled to burn the house down as a training exercise some time this winter or spring, so I&rsquo;m glad I got the opportunity to record the house against a dramatic sunrise.</p>\\r\\n<p>This shot was taken with a Nikon D80 on a tripod. A Sigma 10-20mm superwide and 1 second exposure. This image is <span class=\\"caps\\">NOT</span> <span class=\\"caps\\">HDR</span>. I did however bump up the curves a tad to get the sky true to what I saw. Although I have my in-camera settings set for saturation I still can&rsquo;t get the D80 to record the colors truer to life. Or it could be the <span class=\\"caps\\">RAW</span> conversion when I sync to Aperture.</p>", "category": [], "read_count": 0, "description": "Shot of an old abandoned 200 year old house in Wesley Chapel, North Carolina", "title": "Rent to Own", "related_content": [], "markup": "textile", "tags": "photography, nikon, north carolina", "excerpt": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>", "publish_on": null, "blog": [], "created_on": "2010-01-17 08:39:54", "published": true, "keywords": "photography, abandoned, structure, house, antique, old", "updated_on": "2011-10-15 08:42:34", "expire_on": null, "slug": "rent-to-own"}}]	Rent to Own	0	2
