t take this much further but may do as a finished piece in gouache/watercolor at a later date.</p>", "publish_on": null, "blog": [], "created_on": "2010-10-06 08:46:25", "published": true, "keywords": "Drawing, sketch, pencil, ram, study, wildlife", "updated_on": "2011-10-15 08:48:36", "expire_on": null, "slug": "ram-sketch"}}]	Ram Sketch	0	4
