it</a> and <a href=\\"http://twitter.com/bryanveloso\\">Bryan Veloso</a> for keeping me in check during the early sketch phases. You guys rock!</p>\\r\\n<p>Click the image above to see it larger on flickr or <a href=\\"http://www.flickr.com/photos/busyashell/5140503335/lightbox/\\">View on Black</a></p>", "publish_on": null, "blog": [], "created_on": "2010-11-02 08:49:59", "published": true, "keywords": "illustration, python, learn python the hard way, book, cover", "updated_on": "2011-10-15 08:51:53", "expire_on": null, "slug": "python-illustration"}}]	Python Illustration	0	6
