13	13	8	15	json	[{"pk": 8, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/5615797327/\\" title=\\"Self Portrait Caricature Painting by greg.newman, on Flickr\\"><img alt=\\"Self Portrait Caricature Painting\\" height=\\"390\\" src=\\"http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Most people know me as a &ldquo;Devigner&rdquo; (developer + designer) or &ldquo;Hybrid&rdquo; doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.</p>\\r\\n<p>I&rsquo;ve done a lot of portraits over the years and used to do wildlife art but I really never thought about caricature before. I found this a perfect fit for leaving this comfort zone of mine. One of the assignments from Paul was to do a self-portrait caricature. Once I got started sketching I asked my self why I wanted to do this again? This was really a grueling assignment. After literally about two dozen sketches I finally landed on a <a href=\\"http://dribbble.com/shots/131350-Self-Portrait-Take-3-516\\">likeness I was happy with</a> and started painting. This piece was painted in Photoshop using standard brushes and took about 25 hours. Probably more due to the fact that I was overly critical painting myself for a change.</p>\\r\\n<p>Above is the finished piece which I&rsquo;m now using as my profile pic on <a href=\\"http://twitter.com/gregnewman\\">twitter</a> these days. If you&rsquo;re an artist and want to jump to a new level, I recommend Paul&rsquo;s course.</p>\\r\\n<p>I put together a time-lapse of the painting process on dribbble a few weeks ago that you can <a href=\\"http://drbl.in/YKh\\">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn&rsquo;t have a replace image feature so you&rsquo;ll have to refresh to watch it again. Sorry!</p>", "category": [], "read_count": 0, "description": "Self portrait caricature painting.  Greg Newman.", "title": "Self Portrait Caricature Painting", "related_content": [], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<p><a href=\\"http://www.flickr.com/photos/busyashell/5615797327/\\" title=\\"Self Portrait Caricature Painting by greg.newman, on Flickr\\"><img alt=\\"Self Portrait Caricature Painting\\" height=\\"390\\" src=\\"http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Most people know me as a &ldquo;Devigner&rdquo; (developer + designer) or &ldquo;Hybrid&rdquo; doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.</p>", "publish_on": null, "blog": [], "created_on": "2011-04-13 08:53:32", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-15 08:54:58", "expire_on": null, "slug": "self-portrait-caricature-painting"}}]	Self Portrait Caricature Painting	0	8
14	14	9	15	json	[{"pk": 9, "model": "blog.entry", "fields": {"body": "<p>Go ahead. &nbsp;Say it! PUDDING POPS!!</p>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/5925578711/\\" title=\\"Bill Cosby by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg\\" width=\\"500\\" height=\\"339\\" alt=\\"Bill Cosby\\" /></a></p>\\r\\n<p>It's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p>\\r\\n<p>To try and catch up. &nbsp;I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4. &nbsp;That will require a post of its own.</p>\\r\\n<p>I'm in the process of setting up a society6 store as well and this <a href=\\"http://society6.com/gregnewman\\" target=\\"_self\\">print is available at small sizes</a>.</p>", "category": [], "read_count": 0, "description": "Photoshop painting of Bill Cosby.  Pudding Pops!!", "title": "Bill Cosby", "related_content": [], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<p>Go ahead. &nbsp;Say it! PUDDING POPS!!</p>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/5925578711/\\" title=\\"Bill Cosby by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg\\" width=\\"500\\" height=\\"339\\" alt=\\"Bill Cosby\\" /></a></p>\\r\\n<p>It's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p>\\r\\n<p>To try and catch up. &nbsp;I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4. &nbsp;That will require a post of its own.</p>\\r\\n<p>I'm in the process of setting up a society6 store as well and this <a href=\\"http://society6.com/gregnewman\\" target=\\"_self\\">print is available at small sizes</a>.</p>", "publish_on": null, "blog": [], "created_on": "2011-09-13 08:54:58", "published": true, "keywords": "Bill Cosby, painting, portrait, caricature, photoshop", "updated_on": "2011-10-15 08:57:33", "expire_on": null, "slug": "bill-cosby"}}]	Bill Cosby	0	9
53	53	1	15	json	[{"pk": 1, "model": "blog.entry", "fields": {"body": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it's <span class=\\"caps\\">HDR</span>, some say it's got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It's not a hard process. It's something I've refined to work for me and over time, it's become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I'm great at lighting).</p>\\r\\n<p>Feel free to use the techniques but please don't republish this article or the images used in it.</p>\\r\\n<p><strong>Note:</strong> Click any image to see larger views.</p>\\r\\n<h3>Shot Details</h3>\\r\\n<p>For this shot, I setup under a bridge in the mid afternoon sun. Dialed down so I could overpower the sun coming in from the sides of the bridge and setup a SB-600 controlled via <span class=\\"caps\\">CLS</span> to the left of the camera through a white umbrella.</p>\\r\\n<h3>Reduce Saturation of <span class=\\"caps\\">RAW</span> Image</h3>\\r\\n<p>I don't like overly saturated images so the first thing I do is reduce the overall saturation. I usually go back in later and add in a little saturation for certain colors which we'll do in a later step.<a href=\\"http://www.flickr.com/photos/74337277@N00/2437728674\\" title=\\"View 'Post Article - Step 1' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article - Step 1\\" border=\\"0\\" src=\\"http://static.flickr.com/3007/2437728674_4307325f2c_m.jpg\\" /></a></p>\\r\\n<h3>Vignette</h3>\\r\\n<p>For some images, vignettes work nicely. Especially this image because I think combined with the graffiti it adds a feel of darkness and grunge.</p>\\r\\n<h3>Increase Saturation in Blues</h3>\\r\\n<p>Now I'll add back in some saturation for just the blues which will help pull out Brodey's eyes and shirt. A little bit of blue exists in the graffiti which will make for some nice accents.</p>\\r\\n<h3>Add Definition</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729292/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"130\\" src=\\"http://farm3.static.flickr.com/2249/2437729292_41875dfc42_o.jpg\\" width=\\"281\\" /></a>Before I send the image over to Photoshop, Aperture 2.0 has a very nice definition tool which I use to prep the image with some detail. In version 1.5 (the original image) I used the edge sharpen tool.</p>\\r\\n<h3>Send to Photoshop</h3>\\r\\n<p>This is as far as I go in Aperture. With Aperture 2.1 you can do a lot of the following steps but I prefer photoshop for the heavier lifting.</p>\\r\\n<h3>Duplicate Base Layer and Add A S-Curve</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729732/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"100\\" src=\\"http://farm3.static.flickr.com/2041/2437729732_4cdd7bd594_t.jpg\\" width=\\"92\\" /></a><a href=\\"http://www.flickr.com/photos/busyashell/2436909305/\\" title=\\"Post Article - S Curve by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S Curve\\" height=\\"87\\" src=\\"http://farm4.static.flickr.com/3099/2436909305_112ecfe788_t.jpg\\" width=\\"100\\" /></a>Duplicate the base layer and go to Image &gt;&gt; Adjust &gt;&gt; Curves to add an S-Curve. I always click on options and choose \\"Enhance Monochromatic Contrast\\". It will effect the luminosity of the image this way instead of blowing your colors.</p>\\r\\n<h3>Shadow/Highlight</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2436909517/\\" title=\\"Post Article - S/H by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S/H\\" height=\\"57\\" src=\\"http://farm3.static.flickr.com/2137/2436909517_63a37f3d1c_t.jpg\\" width=\\"100\\" /></a>With the duplicated layer still selected, go to Image &gt;&gt; Adjust &gt;&gt; Highlight/Shadow. Unless the highlights are blown, I typically only work with the shadows to lighten some of the dark areas. For this image my main concern is Brodey's hair, shirt and a little bit of the graffiti. I think this is a fantastic tool and one that is often overlooked in photoshop.</p>\\r\\n<h3>Duplicate Layer and Set To Soft Light</h3>\\r\\n<p>Duplicate this newly edited layer (your second layer) and set the blending mode to \\"Soft Light\\". Most of my images seem to work best with this blending mode. \\"Vivid Light\\" and a few others can be used as well so play around after the next step and see which you prefer for the image you're working on.</p>\\r\\n<h3>High Pass For Detail</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437730498\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3215/2437730498_aeebe195a6_m.jpg\\" /></a>I'm a fan of using High Pass for adding detail instead of unsharp mask. I think it does a much more painterly job when sharpening and can add some very nice effects to the image. Go to filters &gt;&gt; other &gt;&gt; High Pass and set the radius slider to about 9. This is highly dependent on the image, but for most I find this setting where I like it. The reason I set the blending mode prior to this step is so I can see the effect of the High Pass tool in real time. If you don't, the image will look embossed like the tiny preview in the dialog.</p>\\r\\n<h3>Dodge Hair, Eyes and Wrinkles</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437731236\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2203/2437731236_38afe434f3_m.jpg\\" /></a>I go back to layer two, the layer that I did the curves and highlight/shadow to and dodge (lighten) the midtones in the eyes, hair and shirt's wrinkles to pull out some more details. If you dodge the wrinkles in the clothing, it tends to give it a more three dimensional look.</p>\\r\\n<h3>Burn Shadows in Wrinkles</h3>\\r\\n<p>After I dodge, I usually go back and burn some of the wrinkles just to pull out more of that third dimension. Be careful not to pull the focus of the image into a area where you don't want it.</p>\\r\\n<h3>Duplicate Layer and Move to Top</h3>\\r\\n<p>When the dodge and burn is complete, duplicate the layer and move it to the top of the stack. We're going to soften the image a little. When using the highpass and dodge tools, the image can quickly become too harsh with detail in my taste. Some people may want to avoid this step but I typically do it on all portraits. It softens the skin too and helps hide blemishes.</p>\\r\\n<h3>Add Gaussian Blur</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2436911365\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3206/2436911365_6ef91e5eee_m.jpg\\" /></a>Choose Filter &gt;&gt; Blur &gt;&gt; Guassian and set your radius slider to around 1.5, just enough to blur the image and hide some of the harsh details. Apply the filter and set the layers opacity to your liking. For this image I set it to about 80% opacity. Notice you still have more detail than the original image but not too harsh.</p>\\r\\n<h3>Step Fifteen Erase Eyes</h3>\\r\\n<p>Now that the image is softened, I want the original harsh detail from the earlier steps in the eyes to draw them out. I use the eraser tool with a soft edged brush to remove the gaussian layer at the eyes.</p>\\r\\n<p>When I'm satisfied with my edits and save the image which sends it back to Aperture for cataloging.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/74337277@N00/2437732588\\" title=\\"View 'Post Article' on Flickr.com\\"><img alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2233/2437732588_320a56291f.jpg\\" width=\\"467\\" /></a></div>", "category": [2], "read_count": 3, "description": "Recipe for creating a painterly effect on your photographs.", "title": "Painterly Portrait Processing", "related_content": [2], "markup": "textile", "tags": "photography, photoshop, aperture", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/brodey.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nSince posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it's <span class=\\"caps\\">HDR</span>, some say it's got the Dave Hill feel to it.\\r\\n\\r\\nI will go through my recipe in detail. It's not a hard process. It's something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).", "publish_on": null, "blog": [1], "created_on": "2010-01-03 08:34:26", "published": true, "keywords": "photography, post-processing, photoshop, aperture, painterly, effects, sharpening", "updated_on": "2011-10-27 07:23:10", "expire_on": null, "slug": "painterly-portrait-processing"}}]	Painterly Portrait Processing	1	1
15	15	5	15	json	[{"pk": 5, "model": "blog.entry", "fields": {"body": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5095959027/\\" title=\\"Chimp Study by greg.newman, on Flickr\\"><img alt=\\"Chimp Study\\" height=\\"300\\" src=\\"http://farm5.static.flickr.com/4124/5095959027_51bd4dc5ac.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>I&rsquo;m planning out a painting for my son of a chimpanzee. He&rsquo;s fascinated by monkeys. This is one of the studies from the sketchbook.</p>", "category": [3, 1], "read_count": 0, "description": "Chimp study sketch", "title": "Chimp Study", "related_content": [9, 7, 6, 4], "markup": "textile", "tags": "drawing, graphite, pencil, moleskine, art", "excerpt": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5095959027/\\" title=\\"Chimp Study by greg.newman, on Flickr\\"><img alt=\\"Chimp Study\\" height=\\"300\\" src=\\"http://farm5.static.flickr.com/4124/5095959027_51bd4dc5ac.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>I&rsquo;m planning out a painting for my son of a chimpanzee. He&rsquo;s fascinated by monkeys. This is one of the studies from the sketchbook.</p>", "publish_on": null, "blog": [1], "created_on": "2010-10-19 08:48:36", "published": true, "keywords": "art, illustration, wildlife, pencil. drawing, sketch, chimp", "updated_on": "2011-10-15 08:57:59", "expire_on": null, "slug": "chimp-study"}}]	Chimp Study	1	5
