D\\" /></a></div>\\r\\n<p>Maurice Jones Drew of the Jaguars is number three in this series. &nbsp;I'm way into number four and delayed showing this one because I was working on the screencast that a bunch of people have requested I do. &nbsp;Special thanks to my brother, <a href=\\"http://twitter.com/#!/tuckerjoenz\\" target=\\"_blank\\">Tucker</a>, for his help in editing the screencast.</p>", "publish_on": null, "blog": [], "created_on": "2011-10-10 09:01:48", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait, NFL, Maurice Jones Drew, screencast", "updated_on": "2011-10-15 09:03:38", "expire_on": null, "slug": "faces-nfl-project-mjd"}}]	Faces of the NFL Project - MJD	0	12
