20	20	9	15	json	[{"pk": 9, "model": "blog.entry", "fields": {"body": "<p>Go ahead. &nbsp;Say it! PUDDING POPS!!</p>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/5925578711/\\" title=\\"Bill Cosby by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg\\" width=\\"500\\" height=\\"339\\" alt=\\"Bill Cosby\\" /></a></p>\\r\\n<p>It's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p><p>To try and catch up. &nbsp;I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4. &nbsp;That will require a post of its own.</p><p>I'm in the process of setting up a society6 store as well and this <a href=\\"http://society6.com/gregnewman\\" target=\\"_self\\">print is available at small sizes</a>.</p>", "category": [3, 1], "read_count": 2, "description": "Photoshop painting of Bill Cosby.  Pudding Pops!!", "title": "Bill Cosby", "related_content": [12, 11, 10, 8, 7, 5, 4], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<p>Go ahead. &nbsp;Say it! PUDDING POPS!!</p>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/5925578711/\\" title=\\"Bill Cosby by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg\\" width=\\"500\\" height=\\"339\\" alt=\\"Bill Cosby\\" /></a></p>\\r\\n<p>It's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p><p>To try and catch up. &nbsp;I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4. &nbsp;That will require a post of its own.</p><p>I'm in the process of setting up a society6 store as well and this <a href=\\"http://society6.com/gregnewman\\" target=\\"_self\\">print is available at small sizes</a>.</p>", "publish_on": null, "blog": [1], "created_on": "2011-09-13 08:54:58", "published": true, "keywords": "Bill Cosby, painting, portrait, caricature, photoshop", "updated_on": "2011-10-15 09:50:42", "expire_on": null, "slug": "bill-cosby"}}]	Bill Cosby	1	9
54	54	2	15	json	[{"pk": 2, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of '09 I haven't had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>\\r\\n<p>We live in the outskirts of Charlotte where there's a comfortable mix of farms, countryside, history and hints of big city life. I've driven by this location many times since we've been here and have wanted to shoot it, specifically at sunset. The sunrises are spectacular here, and I'm a morning person, so why not get out and create some great images.</p>\\r\\n<p>This house has to be about a hundred years old or older judging from the size of the timbers framing the structure. I was able to see through missing floorboards and broken lattice work. Pieces of furniture still adorn the house, covered in dust and dirt. Old plastic bottles and toys littered the floor and yard. A dog bowl hinted at the one-time existence of pets.</p>\\r\\n<p>What struck me as humorous was a sign behind the property that read \\"Rent to Own\\" with a realtors phone number scribed in marker. The local fire department (if I have the property correct) has scheduled to burn the house down as a training exercise some time this winter or spring, so I'm glad I got the opportunity to record the house against a dramatic sunrise.</p>\\r\\n<p>This shot was taken with a Nikon D80 on a tripod. A Sigma 10-20mm superwide and 1 second exposure. This image is <span class=\\"caps\\">NOT</span> <span class=\\"caps\\">HDR</span>. I did however bump up the curves a tad to get the sky true to what I saw. Although I have my in-camera settings set for saturation I still can't get the D80 to record the colors truer to life. Or it could be the <span class=\\"caps\\">RAW</span> conversion when I sync to Aperture.</p>", "category": [2], "read_count": 3, "description": "Shot of an old abandoned 200 year old house in Wesley Chapel, North Carolina", "title": "Rent to Own", "related_content": [1], "markup": "textile", "tags": "photography, nikon, north carolina", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/rent.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nSince relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.", "publish_on": null, "blog": [1], "created_on": "2010-01-17 08:39:54", "published": true, "keywords": "photography, abandoned, structure, house, antique, old", "updated_on": "2011-10-27 07:24:22", "expire_on": null, "slug": "rent-to-own"}}]	Rent to Own	1	2
