0-27 04:58:25", "expire_on": null, "slug": "bill-cosby"}}]	Bill Cosby	1	9
28	28	9	15	json	[{"pk": 9, "model": "blog.entry", "fields": {"body": "<p>Go ahead. &nbsp;Say it! PUDDING POPS!!</p>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/5925578711/\\" title=\\"Bill Cosby by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6129/5925578711_4cdfd29367.jpg\\" width=\\"500\\" height=\\"339\\" alt=\\"Bill Cosby\\" /></a></p>\\r\\n<p>It's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.</p><p>To try and catch up. &nbsp;I aquired a cintiq and this painting was done for nothing except to test it out and see how it performed compared to my intuos4. &nbsp;That will require a post of its own.</p><p>I'm in the process of setting up a society6 store as well and this <a href=\\"http://society6.com/gregnewman\\" target=\\"_self\\">print is available at small sizes</a>.</p>", "category": [3, 1], "read_count": 2, "description": "Photoshop painting of Bill Cosby.  Pudding Pops!!", "title": "Bill Cosby", "related_content": [12, 11, 10, 8, 7, 5, 4], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/cosby-dribbble.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nGo ahead. &nbsp;Say it! PUDDING POPS!!\\r\\n\\r\\nIt's been a while since I've posted. &nbsp;I moved the site over to Virb last month and didn't want to post until the designs are done and I can make this space look nice but too much awesome is going on.", "publish_on": null, "blog": [1], "created_on": "2011-09-13 08:54:58", "published": true, "keywords": "Bill Cosby, painting, portrait, caricature, photoshop", "updated_on": "2011-10-27 04:58:49", "expire_on": null, "slug": "bill-cosby"}}]	Bill Cosby	1	9
29	29	8	15	json	[{"pk": 8, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/5615797327/\\" title=\\"Self Portrait Caricature Painting by greg.newman, on Flickr\\"><img alt=\\"Self Portrait Caricature Painting\\" height=\\"390\\" src=\\"http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Most people know me as a &ldquo;Devigner&rdquo; (developer + designer) or &ldquo;Hybrid&rdquo; doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.</p>\\r\\n<p>I&rsquo;ve done a lot of portraits over the years and used to do wildlife art but I really never thought about caricature before. I found this a perfect fit for leaving this comfort zone of mine. One of the assignments from Paul was to do a self-portrait caricature. Once I got started sketching I asked my self why I wanted to do this again? This was really a grueling assignment. After literally about two dozen sketches I finally landed on a <a href=\\"http://dribbble.com/shots/131350-Self-Portrait-Take-3-516\\">likeness I was happy with</a> and started painting. This piece was painted in Photoshop using standard brushes and took about 25 hours. Probably more due to the fact that I was overly critical painting myself for a change.</p>\\r\\n<p>Above is the finished piece which I&rsquo;m now using as my profile pic on <a href=\\"http://twitter.com/gregnewman\\">twitter</a> these days. If you&rsquo;re an artist and want to jump to a new level, I recommend Paul&rsquo;s course.</p>\\r\\n<p>I put together a time-lapse of the painting process on dribbble a few weeks ago that you can <a href=\\"http://drbl.in/YKh\\">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn&rsquo;t have a replace image feature so you&rsquo;ll have to refresh to watch it again. Sorry!</p>", "category": [3, 1], "read_count": 3, "description": "Self portrait caricature painting.  Greg Newman.", "title": "Self Portrait Caricature Painting", "related_content": [11, 10, 9, 7], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/self_portrait-copy.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nMost people know me as a &ldquo;Devigner&rdquo; (developer + designer) or &ldquo;Hybrid&rdquo; doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.", "publish_on": null, "blog": [1], "created_on": "2011-04-13 08:53:32", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-27 04:59:26", "expire_on": null, "slug": "self-portrait-caricature-painting"}}]	Self Portrait Caricature Painting	1	8
