37	37	11	15	json	[{"pk": 11, "model": "blog.entry", "fields": {"body": "<p>I already <a href=\\"http://gregnewman.org/blog/text/13427725\\">mentioned</a> about the Faces of the NFL project and the secrecy associated with it.<br />This is painting number two in the series (of ten).   Drew Brees.   It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)</p>\\r\\n<div style=\\"align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/6145503790/\\" title=\\"Face of the NFL #2 - Drew Brees by greg.newman, on Flickr\\"><img src=\\"http://farm7.static.flickr.com/6153/6145503790_8edc5efd12.jpg\\" width=\\"386\\" height=\\"500\\" alt=\\"Face of the NFL #2 - Drew Brees\\" /></a></div>", "category": [3, 1], "read_count": 7, "description": "Caricature painting of Drew Brees; Faces of the NFL project.", "title": "Faces of the NFL Project - Drew Brees", "related_content": [12, 10, 9, 8], "markup": "textile", "tags": "art, photoshop, caricature, illustration, portrait, NFL", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/brees_dribbble.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nI already <a href=\\"http://gregnewman.org/blog/text/13427725\\">mentioned</a> about the Faces of the NFL project and the secrecy associated with it.<br />This is painting number two in the series (of ten).   Drew Brees.   It's been a challenge to try and keep the paintings a loose as possible while still staying within my style. (A client request)", "publish_on": null, "blog": [1], "created_on": "2011-09-13 08:59:50", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait, NFL, Drew Brees", "updated_on": "2011-10-27 06:19:13", "expire_on": null, "slug": "faces-nfl-project-drew-brees"}}]	Faces of the NFL Project - Drew Brees	1	11
38	38	8	15	json	[{"pk": 8, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/5615797327/\\" title=\\"Self Portrait Caricature Painting by greg.newman, on Flickr\\"><img alt=\\"Self Portrait Caricature Painting\\" height=\\"390\\" src=\\"http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Most people know me as a \\"Devigner&rdquo; (developer + designer) or \\"Hybrid&rdquo; doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.</p>\\r\\n<p>I&rsquo;ve done a lot of portraits over the years and used to do wildlife art but I really never thought about caricature before. I found this a perfect fit for leaving this comfort zone of mine. One of the assignments from Paul was to do a self-portrait caricature. Once I got started sketching I asked my self why I wanted to do this again? This was really a grueling assignment. After literally about two dozen sketches I finally landed on a <a href=\\"http://dribbble.com/shots/131350-Self-Portrait-Take-3-516\\">likeness I was happy with</a> and started painting. This piece was painted in Photoshop using standard brushes and took about 25 hours. Probably more due to the fact that I was overly critical painting myself for a change.</p>\\r\\n<p>Above is the finished piece which I&rsquo;m now using as my profile pic on <a href=\\"http://twitter.com/gregnewman\\">twitter</a> these days. If you&rsquo;re an artist and want to jump to a new level, I recommend Paul&rsquo;s course.</p>\\r\\n<p>I put together a time-lapse of the painting process on dribbble a few weeks ago that you can <a href=\\"http://drbl.in/YKh\\">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn&rsquo;t have a replace image feature so you&rsquo;ll have to refresh to watch it again. Sorry!</p>", "category": [3, 1], "read_count": 3, "description": "Self portrait caricature painting.  Greg Newman.", "title": "Self Portrait Caricature Painting", "related_content": [11, 10, 9, 7], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/greg_self_portrait_update.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nMost people know me as a \\"Devigner\\" (developer + designer) or \\"Hybrid\\" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. ", "publish_on": null, "blog": [1], "created_on": "2011-04-13 08:53:32", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-27 06:21:00", "expire_on": null, "slug": "self-portrait-caricature-painting"}}]	Self Portrait Caricature Painting	1	8
