r a time-lapse of the painting process on dribbble a few weeks ago that you can <a href=\\"http://drbl.in/YKh\\">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn&rsquo;t have a replace image feature so you&rsquo;ll have to refresh to watch it again. Sorry!</p>", "category": [3, 1], "read_count": 3, "description": "Self portrait caricature painting.  Greg Newman.", "title": "Self Portrait Caricature Painting", "related_content": [11, 10, 9, 7], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/greg_self_portrait_update.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nMost people know me as a \\"Devigner\\" (developer + designer) or \\"Hybrid\\" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. ", "publish_on": null, "blog": [1], "created_on": "2011-04-13 08:53:32", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-27 06:23:02", "expire_on": null, "slug": "self-portrait-caricature-painting"}}]	Self Portrait Caricature Painting	1	8
40	40	3	15	json	[{"pk": 3, "model": "blog.entry", "fields": {"body": "<p>Friday (June 11th), I made a public announcement on <a href=\\"http://twitter.com/gregnewman/status/15932515611\\">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it&rsquo;s still too long of a read!</p>\\r\\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there&rsquo;s a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>\\r\\n<h3>The search</h3>\\r\\n<p>My mother was sixteen years old when I was born. My father twenty. Anyone can understand the circumstance that led to my adoption. That is obvious. In my mind&rsquo;s eye I figured the two of them probably went their separate ways. I would find my biological mother, ask her questions, and maybe then be able to find my biological father as well. In no way was I prepared for the reality of it. A more perfect set of circumstances.</p>\\r\\n<p>I&rsquo;ve been searching for my birth-mother for approximately twenty years but really got serious about it after my son was born almost fifteen years ago. Twelve years ago my wife spent days or weeks, filling out adoption registries on the internet. They went unanswered. We hired a private investigator who specialized in adoption searches seven years ago. They worked on the case for one year and turned up nothing. I had very little to go on. I had no names and only non-identifying information. The adoptions in Wyoming are closed requiring court orders for information. Something that requires a medical condition. The hospital and young mothers home in Denver, where I was born, is gone. I was informed all records were destroyed, possibly in a fire. We shelved the search about five years ago and while it went unforgotten we had to wait for something to change in adoption laws, or a slight chance someone would see the records that were filed on adoption registries online.</p>\\r\\n<h3>The contact</h3>\\r\\n<p>On Monday, May 24th around 9:00am I got a call from <a href=\\"http://adoptiondatabase.org/\\">AdoptionDatabase.org</a>. I had often received emails from the registries but never a call. The caller told me they had been contacted by a gentleman who said he was 99 percent sure I was his brother. She told me they were marking the record as \\"found\\" and I was to contact his person and do a <span class=\\"caps\\">DNA</span> test. As far as they were concerned that record was closed.</p>\\r\\n<p>They gave me my potential brother&rsquo;s name, phone number and email address. I recognized the area code as Baltimore so my wife and I got on Facebook and quickly filtered him out. I think I shat myself at that point. My wife instantly said he looked like me. He had eerily parallel interests, talents and career as me. And even drove a Jeep (I&rsquo;m a Jeep man).<br />I reached out by phone first with no luck. I chickened out with the voicemail so I sent off an email. I don&rsquo;t think fifteen minutes passed before my phone rang.</p>\\r\\n<p>When he called, he told me we had a sister (Wow!!) and we discussed the non-identifying information I had, confirming it matched.</p>\\r\\n<p>Over the first week the three of us compared pictures, descriptions of ourselves and were sure there was only about a half a percent chance any <span class=\\"caps\\">DNA</span> test would be negative. My potential brother and I ordered the tests kits and sent them in Friday, June 4th. We spent all this week spamming the sites forms to get the results back. They were posted yesterday morning; a perfect match.</p>\\r\\n<p>Now when I said earlier that there was a \\"more perfect set of circumstances\\" I was referring to my new brother and sister. They are both one-hundred percent biological siblings. Both of my birth-parents stayed together and had two more children. While my birth-parents are both deceased and I cannot get to know them personally, I think a better scenario is that I get to know my little sister and little brother and in turn get to know my parents. My little sister has two kids and my brother has three. Instant uncle! In addition I&rsquo;ve got an Aunt in California with two daughters who also have children. Our family just got huge.</p>\\r\\n<p>For those interested, my Brother, Tucker Jones, is on twitter: http://twitter.com/urbanrunic. He&rsquo;s a talented designer, artist, photographer, web dev and film maker. Friend him up! My Sister, Trista, is living in Chicago and also is a talented artist (though she won&rsquo;t admit it). I won&rsquo;t get into personal details out of respect for their privacy.</p>\\r\\n<h3>Going Forward</h3>\\r\\n<p>I don&rsquo;t know where this will go. We&rsquo;re just going to take it day by day and get to know each other. We are planning a reunion this summer and it can&rsquo;t happen soon enough! I can say that in my opinion the three of us clicked instantly. I feel very comfortable talking to both of them as if I had never been separated and I thank both of them for their openness.</p>\\r\\n<h3>Thoughts</h3>\\r\\n<p>I definitely have to thank my wife, Jodi. Without her, my information probably wouldn&rsquo;t be on so many sites available for my siblings to find me. And I have to thank Tucker&rsquo;s girlfriend Kristin for actually using her search powers to find the record. These two ladies are the key to this reunion!</p>\\r\\n<p>To adoptive parents. Please try to put yourself in your children&rsquo;s shoes. No matter what you do or say you must support your child if he/she wants to find their biological family. A deep desire to find them is something that many adoptees feel and being non-supportive is of no help and will only drive a wedge between you. Give them all the information you have and encourage that reunion. It doesn&rsquo;t change the fact that you have raised them as your own. To an adoptee it feels like you have started a book from the middle. While you may know how it ends, you never know why.</p>\\r\\n<p>My adopted Father has been nothing but supportive and is sharing in our joy.</p>\\r\\n<p>Adoptees&hellip; don&rsquo;t give up your search, and keep a very open mind. I do understand that not all reunions are happy, but there are just as many that are.</p>", "category": [4], "read_count": 2, "description": "Adoption reunion story", "title": "The Stork Lost One, An Adoption Reunion", "related_content": [], "markup": "textile", "tags": "Adoption, Life", "excerpt": "<p>Friday (June 11th), I made a public announcement on <a href=\\"http://twitter.com/gregnewman/status/15932515611\\">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it&rsquo;s still too long of a read!</p>\\r\\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there&rsquo;s a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>", "publish_on": null, "blog": [1], "created_on": "2010-06-11 08:42:35", "published": true, "keywords": "adoption, reunion", "updated_on": "2011-10-27 06:23:59", "expire_on": null, "slug": "stork-lost-one-adoption-reunion"}}]	The Stork Lost One, An Adoption Reunion	1	3
41	41	6	15	json	[{"pk": 6, "model": "blog.entry", "fields": {"body": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5140503335/\\" title=\\"Python Illustration by greg.newman, on Flickr\\"><img alt=\\"Python Illustration\\" src=\\"http://farm2.static.flickr.com/1181/5140503335_c599bb225a.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>This is a fun illustration I&rsquo;ve been working on since Friday night. I saw <a href=\\"http://twitter.com/zedshaw\\">Zed Shaw</a> was looking for some art for the cover of his book <a href=\\"http://learnpythonthehardway.org/index\\">\\"Learning Python the Hard Way\\"</a> and thought I&rsquo;d give it a shot. Special thanks to <a href=\\"http://twitter.com/idangazit\\">Idan Gazit</a> and <a href=\\"http://twitter.com/bryanveloso\\">Bryan Veloso</a> for keeping me in check during the early sketch phases. You guys rock!</p>\\r\\n<p>Click the image above to see it larger on flickr or <a href=\\"http://www.flickr.com/photos/busyashell/5140503335/lightbox/\\">View on Black</a></p>", "category": [3, 1], "read_count": 2, "description": "Book cover illustration for \\"Learn Python The Hard Way\\".", "title": "Python Illustration", "related_content": [5, 4], "markup": "textile", "tags": "illustration, art", "excerpt": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5140503335/\\" title=\\"Python Illustration by greg.newman, on Flickr\\"><img alt=\\"Python Illustration\\" src=\\"http://farm2.static.flickr.com/1181/5140503335_c599bb225a.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>This is a fun illustration I&rsquo;ve been working on since Friday night. I saw <a href=\\"http://twitter.com/zedshaw\\">Zed Shaw</a> was looking for some art for the cover of his book <a href=\\"http://learnpythonthehardway.org/index\\">\\"Learning Python the Hard Way\\"</a> and thought I&rsquo;d give it a shot. Special thanks to <a href=\\"http://twitter.com/idangazit\\">Idan Gazit</a> and <a href=\\"http://twitter.com/bryanveloso\\">Bryan Veloso</a> for keeping me in check during the early sketch phases. You guys rock!</p>\\r\\n<p>Click the image above to see it larger on flickr or <a href=\\"http://www.flickr.com/photos/busyashell/5140503335/lightbox/\\">View on Black</a></p>", "publish_on": null, "blog": [1], "created_on": "2010-11-02 08:49:59", "published": true, "keywords": "illustration, python, learn python the hard way, book, cover", "updated_on": "2011-10-27 06:24:47", "expire_on": null, "slug": "python-illustration"}}]	Python Illustration	1	6
42	42	2	15	json	[{"pk": 2, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>\\r\\n<p>We live in the outskirts of Charlotte where there&rsquo;s a comfortable mix of farms, countryside, history and hints of big city life. I&rsquo;ve driven by this location many times since we&rsquo;ve been here and have wanted to shoot it, specifically at sunset. The sunrises are spectacular here, and I&rsquo;m a morning person, so why not get out and create some great images.</p>\\r\\n<p>This house has to be about a hundred years old or older judging from the size of the timbers framing the structure. I was able to see through missing floorboards and broken lattice work. Pieces of furniture still adorn the house, covered in dust and dirt. Old plastic bottles and toys littered the floor and yard. A dog bowl hinted at the one-time existence of pets.</p>\\r\\n<p>What struck me as humorous was a sign behind the property that read \\"Rent to Own\\" with a realtors phone number scribed in marker. The local fire department (if I have the property correct) has scheduled to burn the house down as a training exercise some time this winter or spring, so I&rsquo;m glad I got the opportunity to record the house against a dramatic sunrise.</p>\\r\\n<p>This shot was taken with a Nikon D80 on a tripod. A Sigma 10-20mm superwide and 1 second exposure. This image is <span class=\\"caps\\">NOT</span> <span class=\\"caps\\">HDR</span>. I did however bump up the curves a tad to get the sky true to what I saw. Although I have my in-camera settings set for saturation I still can&rsquo;t get the D80 to record the colors truer to life. Or it could be the <span class=\\"caps\\">RAW</span> conversion when I sync to Aperture.</p>", "category": [2], "read_count": 3, "description": "Shot of an old abandoned 200 year old house in Wesley Chapel, North Carolina", "title": "Rent to Own", "related_content": [1], "markup": "textile", "tags": "photography, nikon, north carolina", "excerpt": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>", "publish_on": null, "blog": [1], "created_on": "2010-01-17 08:39:54", "published": true, "keywords": "photography, abandoned, structure, house, antique, old", "updated_on": "2011-10-27 06:25:16", "expire_on": null, "slug": "rent-to-own"}}]	Rent to Own	1	2
43	43	1	15	json	[{"pk": 1, "model": "blog.entry", "fields": {"body": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it&rsquo;s <span class=\\"caps\\">HDR</span>, some say it&rsquo;s got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It&rsquo;s not a hard process. It&rsquo;s something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).</p>\\r\\n<p>Feel free to use the techniques but please don&rsquo;t republish this article or the images used in it.</p>\\r\\n<p><strong>Note:</strong> Click any image to see larger views.</p>\\r\\n<h3>Shot Details</h3>\\r\\n<p>For this shot, I setup under a bridge in the mid afternoon sun. Dialed down so I could overpower the sun coming in from the sides of the bridge and setup a SB-600 controlled via <span class=\\"caps\\">CLS</span> to the left of the camera through a white umbrella.</p>\\r\\n<h3>Reduce Saturation of <span class=\\"caps\\">RAW</span> Image</h3>\\r\\n<p>I don&rsquo;t like overly saturated images so the first thing I do is reduce the overall saturation. I usually go back in later and add in a little saturation for certain colors which we&rsquo;ll do in a later step.<a href=\\"http://www.flickr.com/photos/74337277@N00/2437728674\\" title=\\"View 'Post Article - Step 1' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article - Step 1\\" border=\\"0\\" src=\\"http://static.flickr.com/3007/2437728674_4307325f2c_m.jpg\\" /></a></p>\\r\\n<h3>Vignette</h3>\\r\\n<p>For some images, vignettes work nicely. Especially this image because I think combined with the graffiti it adds a feel of darkness and grunge.</p>\\r\\n<h3>Increase Saturation in Blues</h3>\\r\\n<p>Now I&rsquo;ll add back in some saturation for just the blues which will help pull out Brodey&rsquo;s eyes and shirt. A little bit of blue exists in the graffiti which will make for some nice accents.</p>\\r\\n<h3>Add Definition</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729292/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"130\\" src=\\"http://farm3.static.flickr.com/2249/2437729292_41875dfc42_o.jpg\\" width=\\"281\\" /></a>Before I send the image over to Photoshop, Aperture 2.0 has a very nice definition tool which I use to prep the image with some detail. In version 1.5 (the original image) I used the edge sharpen tool.</p>\\r\\n<h3>Send to Photoshop</h3>\\r\\n<p>This is as far as I go in Aperture. With Aperture 2.1 you can do a lot of the following steps but I prefer photoshop for the heavier lifting.</p>\\r\\n<h3>Duplicate Base Layer and Add A S-Curve</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729732/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"100\\" src=\\"http://farm3.static.flickr.com/2041/2437729732_4cdd7bd594_t.jpg\\" width=\\"92\\" /></a><a href=\\"http://www.flickr.com/photos/busyashell/2436909305/\\" title=\\"Post Article - S Curve by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S Curve\\" height=\\"87\\" src=\\"http://farm4.static.flickr.com/3099/2436909305_112ecfe788_t.jpg\\" width=\\"100\\" /></a>Duplicate the base layer and go to Image &gt;&gt; Adjust &gt;&gt; Curves to add an S-Curve. I always click on options and choose \\"Enhance Monochromatic Contrast\\". It will effect the luminosity of the image this way instead of blowing your colors.</p>\\r\\n<h3>Shadow/Highlight</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2436909517/\\" title=\\"Post Article - S/H by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S/H\\" height=\\"57\\" src=\\"http://farm3.static.flickr.com/2137/2436909517_63a37f3d1c_t.jpg\\" width=\\"100\\" /></a>With the duplicated layer still selected, go to Image &gt;&gt; Adjust &gt;&gt; Highlight/Shadow. Unless the highlights are blown, I typically only work with the shadows to lighten some of the dark areas. For this image my main concern is Brodey&rsquo;s hair, shirt and a little bit of the graffiti. I think this is a fantastic tool and one that is often overlooked in photoshop.</p>\\r\\n<h3>Duplicate Layer and Set To Soft Light</h3>\\r\\n<p>Duplicate this newly edited layer (your second layer) and set the blending mode to \\"Soft Light\\". Most of my images seem to work best with this blending mode. \\"Vivid Light\\" and a few others can be used as well so play around after the next step and see which you prefer for the image you&rsquo;re working on.</p>\\r\\n<h3>High Pass For Detail</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437730498\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3215/2437730498_aeebe195a6_m.jpg\\" /></a>I&rsquo;m a fan of using High Pass for adding detail instead of unsharp mask. I think it does a much more painterly job when sharpening and can add some very nice effects to the image. Go to filters &gt;&gt; other &gt;&gt; High Pass and set the radius slider to about 9. This is highly dependent on the image, but for most I find this setting where I like it. The reason I set the blending mode prior to this step is so I can see the effect of the High Pass tool in real time. If you don&rsquo;t, the image will look embossed like the tiny preview in the dialog.</p>\\r\\n<h3>Dodge Hair, Eyes and Wrinkles</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437731236\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2203/2437731236_38afe434f3_m.jpg\\" /></a>I go back to layer two, the layer that I did the curves and highlight/shadow to and dodge (lighten) the midtones in the eyes, hair and shirt&rsquo;s wrinkles to pull out some more details. If you dodge the wrinkles in the clothing, it tends to give it a more three dimensional look.</p>\\r\\n<h3>Burn Shadows in Wrinkles</h3>\\r\\n<p>After I dodge, I usually go back and burn some of the wrinkles just to pull out more of that third dimension. Be careful not to pull the focus of the image into a area where you don&rsquo;t want it.</p>\\r\\n<h3>Duplicate Layer and Move to Top</h3>\\r\\n<p>When the dodge and burn is complete, duplicate the layer and move it to the top of the stack. We&rsquo;re going to soften the image a little. When using the highpass and dodge tools, the image can quickly become too harsh with detail in my taste. Some people may want to avoid this step but I typically do it on all portraits. It softens the skin too and helps hide blemishes.</p>\\r\\n<h3>Add Gaussian Blur</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2436911365\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3206/2436911365_6ef91e5eee_m.jpg\\" /></a>Choose Filter &gt;&gt; Blur &gt;&gt; Guassian and set your radius slider to around 1.5, just enough to blur the image and hide some of the harsh details. Apply the filter and set the layers opacity to your liking. For this image I set it to about 80% opacity. Notice you still have more detail than the original image but not too harsh.</p>\\r\\n<h3>Step Fifteen Erase Eyes</h3>\\r\\n<p>Now that the image is softened, I want the original harsh detail from the earlier steps in the eyes to draw them out. I use the eraser tool with a soft edged brush to remove the gaussian layer at the eyes.</p>\\r\\n<p>When I&rsquo;m satisfied with my edits and save the image which sends it back to Aperture for cataloging.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/74337277@N00/2437732588\\" title=\\"View 'Post Article' on Flickr.com\\"><img alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2233/2437732588_320a56291f.jpg\\" width=\\"467\\" /></a></div>", "category": [2], "read_count": 3, "description": "Recipe for creating a painterly effect on your photographs.", "title": "Painterly Portrait Processing", "related_content": [2], "markup": "textile", "tags": "photography, photoshop, aperture", "excerpt": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it&rsquo;s <span class=\\"caps\\">HDR</span>, some say it&rsquo;s got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It&rsquo;s not a hard process. It&rsquo;s something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).</p>", "publish_on": null, "blog": [1], "created_on": "2010-01-03 08:34:26", "published": true, "keywords": "photography, post-processing, photoshop, aperture, painterly, effects, sharpening", "updated_on": "2011-10-27 06:26:04", "expire_on": null, "slug": "painterly-portrait-processing"}}]	Painterly Portrait Processing	1	1
44	44	8	15	json	[{"pk": 8, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/5615797327/\\" title=\\"Self Portrait Caricature Painting by greg.newman, on Flickr\\"><img alt=\\"Self Portrait Caricature Painting\\" height=\\"390\\" src=\\"http://farm6.static.flickr.com/5185/5615797327_88a37e3503.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Most people know me as a \\"Devigner\\" (developer + designer) or \\"Hybrid\\" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven't really done any digital painting before and was never really comfortable with my Wacom Intuos4. Back around Christmas 2010 I decided to poke around online and see what was available and something I could do from the comforts of my home studio. I signed up for the course <a href=\\"http://advancedcaricature.co.uk/\\">Paul Moyse</a> offers and gave it a go.</p>\\r\\n<p>I've done a lot of portraits over the years and used to do wildlife art but I really never thought about caricature before. I found this a perfect fit for leaving this comfort zone of mine. One of the assignments from Paul was to do a self-portrait caricature. Once I got started sketching I asked my self why I wanted to do this again? This was really a grueling assignment. After literally about two dozen sketches I finally landed on a <a href=\\"http://dribbble.com/shots/131350-Self-Portrait-Take-3-516\\">likeness I was happy with</a> and started painting. This piece was painted in Photoshop using standard brushes and took about 25 hours. Probably more due to the fact that I was overly critical painting myself for a change.</p>\\r\\n<p>Above is the finished piece which I'm now using as my profile pic on <a href=\\"http://twitter.com/gregnewman\\">twitter</a> these days. If you're an artist and want to jump to a new level, I recommend Paul's course.</p>\\r\\n<p>I put together a time-lapse of the painting process on dribbble a few weeks ago that you can <a href=\\"http://drbl.in/YKh\\">see over here</a> Unfortunately I neglected to loop the animation and dribbble doesn't have a replace image feature so you'll have to refresh to watch it again. Sorry!</p>", "category": [3, 1], "read_count": 3, "description": "Self portrait caricature painting.  Greg Newman.", "title": "Self Portrait Caricature Painting", "related_content": [11, 10, 9, 7], "markup": "textile", "tags": "illustration, art, photoshop, caricature, painting", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/greg_self_portrait_update.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nMost people know me as a \\"Devigner\\" (developer + designer) or \\"Hybrid\\" doing design and development with Django. One of the things I wanted to do this year was exit my comfort zone and push my personal limits. I haven&rsquo;t really done any digital painting before and was never really comfortable with my Wacom Intuos4. ", "publish_on": null, "blog": [1], "created_on": "2011-04-13 08:53:32", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-27 06:29:32", "expire_on": null, "slug": "self-portrait-caricature-painting"}}]	Self Portrait Caricature Painting	1	8
45	45	7	15	json	[{"pk": 7, "model": "blog.entry", "fields": {"body": "<div style=\\"text-align: center;\\"><img alt=\\"Ozan Value Study\\" height=\\"400\\" src=\\"http://farm6.static.flickr.com/5060/5451969834_449dc1395a.jpg\\" width=\\"284\\" /></div>\\r\\n\\r\\nValue study painted in Photoshop for a course I'm doing in the evenings with the excellent <a href=\\"http://paulmoyse.com/teaching.htm\\">Paul Moyse</a>\\r\\n\\r\\n<a href=\\"http://www.flickr.com/photos/busyashell/5451969834/\\" title=\\"Ozan Value Study by greg.newman, on Flickr\\">View on flickr</a><br />Also on <a href=\\"http://drbl.in/QZd\\">Dribbble</a>", "category": [3, 1], "read_count": 2, "description": "Caricature value study done in photoshop", "title": "Ozan Value Study", "related_content": [10, 9, 8, 5, 4], "markup": "textile", "tags": "art, photoshop, caricature, illustration, portrait", "excerpt": "<img src=\\"http://dl.dropbox.com/u/6062/greg-org/ozan_vs_newman.jpg\\" class=\\"excerpt-img\\" />\\r\\n\\r\\nValue study painted in Photoshop for a course I'm doing in the evenings with the excellent <a href=\\"http://paulmoyse.com/teaching.htm\\">Paul Moyse</a>", "publish_on": null, "blog": [1], "created_on": "2011-02-16 08:51:53", "published": true, "keywords": "caricature, illustration, painting, photoshop, art, portrait", "updated_on": "2011-10-27 06:30:13", "expire_on": null, "slug": "ozan-value-study"}}]	Ozan Value Study	1	7
46	46	6	15	json	[{"pk": 6, "model": "blog.entry", "fields": {"body": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5140503335/\\" title=\\"Python Illustration by greg.newman, on Flickr\\"><img alt=\\"Python Illustration\\" src=\\"http://farm2.static.flickr.com/1181/5140503335_c599bb225a.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>This is a fun illustration I've been working on since Friday night. I saw <a href=\\"http://twitter.com/zedshaw\\">Zed Shaw</a> was looking for some art for the cover of his book <a href=\\"http://learnpythonthehardway.org/index\\">\\"Learning Python the Hard Way\\"</a> and thought I'd give it a shot. Special thanks to <a href=\\"http://twitter.com/idangazit\\">Idan Gazit</a> and <a href=\\"http://twitter.com/bryanveloso\\">Bryan Veloso</a> for keeping me in check during the early sketch phases. You guys rock!</p>\\r\\n<p>Click the image above to see it larger on flickr or <a href=\\"http://www.flickr.com/photos/busyashell/5140503335/lightbox/\\">View on Black</a></p>", "category": [3, 1], "read_count": 2, "description": "Book cover illustration for \\"Learn Python The Hard Way\\".", "title": "Python Illustration", "related_content": [5, 4], "markup": "textile", "tags": "illustration, art", "excerpt": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5140503335/\\" title=\\"Python Illustration by greg.newman, on Flickr\\"><img alt=\\"Python Illustration\\" src=\\"http://farm2.static.flickr.com/1181/5140503335_c599bb225a.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>This is a fun illustration I&rsquo;ve been working on since Friday night. I saw <a href=\\"http://twitter.com/zedshaw\\">Zed Shaw</a> was looking for some art for the cover of his book <a href=\\"http://learnpythonthehardway.org/index\\">\\"Learning Python the Hard Way\\"</a> and thought I&rsquo;d give it a shot. Special thanks to <a href=\\"http://twitter.com/idangazit\\">Idan Gazit</a> and <a href=\\"http://twitter.com/bryanveloso\\">Bryan Veloso</a> for keeping me in check during the early sketch phases. You guys rock!</p>\\r\\n<p>Click the image above to see it larger on flickr or <a href=\\"http://www.flickr.com/photos/busyashell/5140503335/lightbox/\\">View on Black</a></p>", "publish_on": null, "blog": [1], "created_on": "2010-11-02 08:49:59", "published": true, "keywords": "illustration, python, learn python the hard way, book, cover", "updated_on": "2011-10-27 06:30:40", "expire_on": null, "slug": "python-illustration"}}]	Python Illustration	1	6
47	47	5	15	json	[{"pk": 5, "model": "blog.entry", "fields": {"body": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5095959027/\\" title=\\"Chimp Study by greg.newman, on Flickr\\"><img alt=\\"Chimp Study\\" height=\\"300\\" src=\\"http://farm5.static.flickr.com/4124/5095959027_51bd4dc5ac.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>I'm planning out a painting for my son of a chimpanzee. He's fascinated by monkeys. This is one of the studies from the sketchbook.</p>", "category": [3, 1], "read_count": 3, "description": "Chimp study sketch", "title": "Chimp Study", "related_content": [9, 7, 6, 4], "markup": "textile", "tags": "drawing, graphite, pencil, moleskine, art", "excerpt": "<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/5095959027/\\" title=\\"Chimp Study by greg.newman, on Flickr\\"><img alt=\\"Chimp Study\\" height=\\"300\\" src=\\"http://farm5.static.flickr.com/4124/5095959027_51bd4dc5ac.jpg\\" width=\\"400\\" /></a></div>\\r\\n<p>I&rsquo;m planning out a painting for my son of a chimpanzee. He&rsquo;s fascinated by monkeys. This is one of the studies from the sketchbook.</p>", "publish_on": null, "blog": [1], "created_on": "2010-10-19 08:48:36", "published": true, "keywords": "art, illustration, wildlife, pencil. drawing, sketch, chimp", "updated_on": "2011-10-27 06:31:04", "expire_on": null, "slug": "chimp-study"}}]	Chimp Study	1	5
49	49	3	15	json	[{"pk": 3, "model": "blog.entry", "fields": {"body": "<p>Friday (June 11th), I made a public announcement on <a href=\\"http://twitter.com/gregnewman/status/15932515611\\">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it's still too long of a read!</p>\\r\\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there's a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>\\r\\n<h3>The search</h3>\\r\\n<p>My mother was sixteen years old when I was born. My father twenty. Anyone can understand the circumstance that led to my adoption. That is obvious. In my mind's eye I figured the two of them probably went their separate ways. I would find my biological mother, ask her questions, and maybe then be able to find my biological father as well. In no way was I prepared for the reality of it. A more perfect set of circumstances.</p>\\r\\n<p>I've been searching for my birth-mother for approximately twenty years but really got serious about it after my son was born almost fifteen years ago. Twelve years ago my wife spent days or weeks, filling out adoption registries on the internet. They went unanswered. We hired a private investigator who specialized in adoption searches seven years ago. They worked on the case for one year and turned up nothing. I had very little to go on. I had no names and only non-identifying information. The adoptions in Wyoming are closed requiring court orders for information. Something that requires a medical condition. The hospital and young mothers home in Denver, where I was born, is gone. I was informed all records were destroyed, possibly in a fire. We shelved the search about five years ago and while it went unforgotten we had to wait for something to change in adoption laws, or a slight chance someone would see the records that were filed on adoption registries online.</p>\\r\\n<h3>The contact</h3>\\r\\n<p>On Monday, May 24th around 9:00am I got a call from <a href=\\"http://adoptiondatabase.org/\\">AdoptionDatabase.org</a>. I had often received emails from the registries but never a call. The caller told me they had been contacted by a gentleman who said he was 99 percent sure I was his brother. She told me they were marking the record as \\"found\\" and I was to contact his person and do a <span class=\\"caps\\">DNA</span> test. As far as they were concerned that record was closed.</p>\\r\\n<p>They gave me my potential brother's name, phone number and email address. I recognized the area code as Baltimore so my wife and I got on Facebook and quickly filtered him out. I think I shat myself at that point. My wife instantly said he looked like me. He had eerily parallel interests, talents and career as me. And even drove a Jeep (I'm a Jeep man).<br />I reached out by phone first with no luck. I chickened out with the voicemail so I sent off an email. I don't think fifteen minutes passed before my phone rang.</p>\\r\\n<p>When he called, he told me we had a sister (Wow!!) and we discussed the non-identifying information I had, confirming it matched.</p>\\r\\n<p>Over the first week the three of us compared pictures, descriptions of ourselves and were sure there was only about a half a percent chance any <span class=\\"caps\\">DNA</span> test would be negative. My potential brother and I ordered the tests kits and sent them in Friday, June 4th. We spent all this week spamming the sites forms to get the results back. They were posted yesterday morning; a perfect match.</p>\\r\\n<p>Now when I said earlier that there was a \\"more perfect set of circumstances\\" I was referring to my new brother and sister. They are both one-hundred percent biological siblings. Both of my birth-parents stayed together and had two more children. While my birth-parents are both deceased and I cannot get to know them personally, I think a better scenario is that I get to know my little sister and little brother and in turn get to know my parents. My little sister has two kids and my brother has three. Instant uncle! In addition I've got an Aunt in California with two daughters who also have children. Our family just got huge.</p>\\r\\n<p>For those interested, my Brother, Tucker Jones, is on twitter: http://twitter.com/urbanrunic. He's a talented designer, artist, photographer, web dev and film maker. Friend him up! My Sister, Trista, is living in Chicago and also is a talented artist (though she won't admit it). I won't get into personal details out of respect for their privacy.</p>\\r\\n<h3>Going Forward</h3>\\r\\n<p>I don't know where this will go. We're just going to take it day by day and get to know each other. We are planning a reunion this summer and it can't happen soon enough! I can say that in my opinion the three of us clicked instantly. I feel very comfortable talking to both of them as if I had never been separated and I thank both of them for their openness.</p>\\r\\n<h3>Thoughts</h3>\\r\\n<p>I definitely have to thank my wife, Jodi. Without her, my information probably wouldn't be on so many sites available for my siblings to find me. And I have to thank Tucker's girlfriend Kristin for actually using her search powers to find the record. These two ladies are the key to this reunion!</p>\\r\\n<p>To adoptive parents. Please try to put yourself in your children's shoes. No matter what you do or say you must support your child if he/she wants to find their biological family. A deep desire to find them is something that many adoptees feel and being non-supportive is of no help and will only drive a wedge between you. Give them all the information you have and encourage that reunion. It doesn't change the fact that you have raised them as your own. To an adoptee it feels like you have started a book from the middle. While you may know how it ends, you never know why.</p>\\r\\n<p>My adopted Father has been nothing but supportive and is sharing in our joy.</p>\\r\\n<p>Adoptees&hellip; don't give up your search, and keep a very open mind. I do understand that not all reunions are happy, but there are just as many that are.</p>", "category": [4], "read_count": 2, "description": "Adoption reunion story", "title": "The Stork Lost One, An Adoption Reunion", "related_content": [], "markup": "textile", "tags": "Adoption, Life", "excerpt": "<p>Friday (June 11th), I made a public announcement on <a href=\\"http://twitter.com/gregnewman/status/15932515611\\">Twitter</a> <br />and Facebook about some news that has dramatically changed my life for the better and a lot of friends immediately asked me for more context. I started to write this narrative in great detail and then decided to just keep it a little more simple. Sorry if it&rsquo;s still too long of a read!</p>\\r\\n<p>If memory serves me well, around age eight or nine I was told by my parents that I had been adopted at birth. My childhood was good. I cannot complain in that department but there has always been something missing. I think there&rsquo;s a blood bond that needs to be reconnected. As far back as I can remember, I wondered about my birth mother. Things like, where I got my artistic abilities and more importantly, did she think about me. Was she that nice woman running the register in the checkout line?</p>", "publish_on": null, "blog": [1], "created_on": "2010-06-11 08:42:35", "published": true, "keywords": "adoption, reunion", "updated_on": "2011-10-27 06:31:45", "expire_on": null, "slug": "stork-lost-one-adoption-reunion"}}]	The Stork Lost One, An Adoption Reunion	1	3
50	50	2	15	json	[{"pk": 2, "model": "blog.entry", "fields": {"body": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of '09 I haven't had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>\\r\\n<p>We live in the outskirts of Charlotte where there's a comfortable mix of farms, countryside, history and hints of big city life. I've driven by this location many times since we've been here and have wanted to shoot it, specifically at sunset. The sunrises are spectacular here, and I'm a morning person, so why not get out and create some great images.</p>\\r\\n<p>This house has to be about a hundred years old or older judging from the size of the timbers framing the structure. I was able to see through missing floorboards and broken lattice work. Pieces of furniture still adorn the house, covered in dust and dirt. Old plastic bottles and toys littered the floor and yard. A dog bowl hinted at the one-time existence of pets.</p>\\r\\n<p>What struck me as humorous was a sign behind the property that read \\"Rent to Own\\" with a realtors phone number scribed in marker. The local fire department (if I have the property correct) has scheduled to burn the house down as a training exercise some time this winter or spring, so I'm glad I got the opportunity to record the house against a dramatic sunrise.</p>\\r\\n<p>This shot was taken with a Nikon D80 on a tripod. A Sigma 10-20mm superwide and 1 second exposure. This image is <span class=\\"caps\\">NOT</span> <span class=\\"caps\\">HDR</span>. I did however bump up the curves a tad to get the sky true to what I saw. Although I have my in-camera settings set for saturation I still can't get the D80 to record the colors truer to life. Or it could be the <span class=\\"caps\\">RAW</span> conversion when I sync to Aperture.</p>", "category": [2], "read_count": 3, "description": "Shot of an old abandoned 200 year old house in Wesley Chapel, North Carolina", "title": "Rent to Own", "related_content": [1], "markup": "textile", "tags": "photography, nikon, north carolina", "excerpt": "<p><a href=\\"http://www.flickr.com/photos/busyashell/4278304031/\\" title=\\"Rent to Own by greg.newman, on Flickr\\"><img alt=\\"Rent to Own\\" height=\\"291\\" src=\\"http://farm5.static.flickr.com/4016/4278304031_207279eb96.jpg\\" width=\\"465\\" /></a></p>\\r\\n<p>Since relocating my family to Charlotte, North Carolina, in August of &rsquo;09 I haven&rsquo;t had much time (or desire) to go out and shoot. There has been too much going on and workload has blocked the enthusiasm for photography. Yesterday morning the bug to shoot got the best of me and I immediately grabbed my tripod and camera and jumped in the Jeep. Oddly, I did not go straight to this property which is only three miles from my home. Instead, I drove a 25 mile loop only to end up here.</p>", "publish_on": null, "blog": [1], "created_on": "2010-01-17 08:39:54", "published": true, "keywords": "photography, abandoned, structure, house, antique, old", "updated_on": "2011-10-27 06:32:09", "expire_on": null, "slug": "rent-to-own"}}]	Rent to Own	1	2
51	51	1	15	json	[{"pk": 1, "model": "blog.entry", "fields": {"body": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it's <span class=\\"caps\\">HDR</span>, some say it's got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It's not a hard process. It's something I've refined to work for me and over time, it's become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I'm great at lighting).</p>\\r\\n<p>Feel free to use the techniques but please don't republish this article or the images used in it.</p>\\r\\n<p><strong>Note:</strong> Click any image to see larger views.</p>\\r\\n<h3>Shot Details</h3>\\r\\n<p>For this shot, I setup under a bridge in the mid afternoon sun. Dialed down so I could overpower the sun coming in from the sides of the bridge and setup a SB-600 controlled via <span class=\\"caps\\">CLS</span> to the left of the camera through a white umbrella.</p>\\r\\n<h3>Reduce Saturation of <span class=\\"caps\\">RAW</span> Image</h3>\\r\\n<p>I don't like overly saturated images so the first thing I do is reduce the overall saturation. I usually go back in later and add in a little saturation for certain colors which we'll do in a later step.<a href=\\"http://www.flickr.com/photos/74337277@N00/2437728674\\" title=\\"View 'Post Article - Step 1' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article - Step 1\\" border=\\"0\\" src=\\"http://static.flickr.com/3007/2437728674_4307325f2c_m.jpg\\" /></a></p>\\r\\n<h3>Vignette</h3>\\r\\n<p>For some images, vignettes work nicely. Especially this image because I think combined with the graffiti it adds a feel of darkness and grunge.</p>\\r\\n<h3>Increase Saturation in Blues</h3>\\r\\n<p>Now I'll add back in some saturation for just the blues which will help pull out Brodey's eyes and shirt. A little bit of blue exists in the graffiti which will make for some nice accents.</p>\\r\\n<h3>Add Definition</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729292/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"130\\" src=\\"http://farm3.static.flickr.com/2249/2437729292_41875dfc42_o.jpg\\" width=\\"281\\" /></a>Before I send the image over to Photoshop, Aperture 2.0 has a very nice definition tool which I use to prep the image with some detail. In version 1.5 (the original image) I used the edge sharpen tool.</p>\\r\\n<h3>Send to Photoshop</h3>\\r\\n<p>This is as far as I go in Aperture. With Aperture 2.1 you can do a lot of the following steps but I prefer photoshop for the heavier lifting.</p>\\r\\n<h3>Duplicate Base Layer and Add A S-Curve</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2437729732/\\" title=\\"Post Article by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article\\" height=\\"100\\" src=\\"http://farm3.static.flickr.com/2041/2437729732_4cdd7bd594_t.jpg\\" width=\\"92\\" /></a><a href=\\"http://www.flickr.com/photos/busyashell/2436909305/\\" title=\\"Post Article - S Curve by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S Curve\\" height=\\"87\\" src=\\"http://farm4.static.flickr.com/3099/2436909305_112ecfe788_t.jpg\\" width=\\"100\\" /></a>Duplicate the base layer and go to Image &gt;&gt; Adjust &gt;&gt; Curves to add an S-Curve. I always click on options and choose \\"Enhance Monochromatic Contrast\\". It will effect the luminosity of the image this way instead of blowing your colors.</p>\\r\\n<h3>Shadow/Highlight</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/busyashell/2436909517/\\" title=\\"Post Article - S/H by greg.newman, on Flickr\\"><img align=\\"right\\" alt=\\"Post Article - S/H\\" height=\\"57\\" src=\\"http://farm3.static.flickr.com/2137/2436909517_63a37f3d1c_t.jpg\\" width=\\"100\\" /></a>With the duplicated layer still selected, go to Image &gt;&gt; Adjust &gt;&gt; Highlight/Shadow. Unless the highlights are blown, I typically only work with the shadows to lighten some of the dark areas. For this image my main concern is Brodey's hair, shirt and a little bit of the graffiti. I think this is a fantastic tool and one that is often overlooked in photoshop.</p>\\r\\n<h3>Duplicate Layer and Set To Soft Light</h3>\\r\\n<p>Duplicate this newly edited layer (your second layer) and set the blending mode to \\"Soft Light\\". Most of my images seem to work best with this blending mode. \\"Vivid Light\\" and a few others can be used as well so play around after the next step and see which you prefer for the image you're working on.</p>\\r\\n<h3>High Pass For Detail</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437730498\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3215/2437730498_aeebe195a6_m.jpg\\" /></a>I'm a fan of using High Pass for adding detail instead of unsharp mask. I think it does a much more painterly job when sharpening and can add some very nice effects to the image. Go to filters &gt;&gt; other &gt;&gt; High Pass and set the radius slider to about 9. This is highly dependent on the image, but for most I find this setting where I like it. The reason I set the blending mode prior to this step is so I can see the effect of the High Pass tool in real time. If you don't, the image will look embossed like the tiny preview in the dialog.</p>\\r\\n<h3>Dodge Hair, Eyes and Wrinkles</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2437731236\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2203/2437731236_38afe434f3_m.jpg\\" /></a>I go back to layer two, the layer that I did the curves and highlight/shadow to and dodge (lighten) the midtones in the eyes, hair and shirt's wrinkles to pull out some more details. If you dodge the wrinkles in the clothing, it tends to give it a more three dimensional look.</p>\\r\\n<h3>Burn Shadows in Wrinkles</h3>\\r\\n<p>After I dodge, I usually go back and burn some of the wrinkles just to pull out more of that third dimension. Be careful not to pull the focus of the image into a area where you don't want it.</p>\\r\\n<h3>Duplicate Layer and Move to Top</h3>\\r\\n<p>When the dodge and burn is complete, duplicate the layer and move it to the top of the stack. We're going to soften the image a little. When using the highpass and dodge tools, the image can quickly become too harsh with detail in my taste. Some people may want to avoid this step but I typically do it on all portraits. It softens the skin too and helps hide blemishes.</p>\\r\\n<h3>Add Gaussian Blur</h3>\\r\\n<p><a href=\\"http://www.flickr.com/photos/74337277@N00/2436911365\\" title=\\"View 'Post Article' on Flickr.com\\"><img align=\\"right\\" alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/3206/2436911365_6ef91e5eee_m.jpg\\" /></a>Choose Filter &gt;&gt; Blur &gt;&gt; Guassian and set your radius slider to around 1.5, just enough to blur the image and hide some of the harsh details. Apply the filter and set the layers opacity to your liking. For this image I set it to about 80% opacity. Notice you still have more detail than the original image but not too harsh.</p>\\r\\n<h3>Step Fifteen Erase Eyes</h3>\\r\\n<p>Now that the image is softened, I want the original harsh detail from the earlier steps in the eyes to draw them out. I use the eraser tool with a soft edged brush to remove the gaussian layer at the eyes.</p>\\r\\n<p>When I'm satisfied with my edits and save the image which sends it back to Aperture for cataloging.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/74337277@N00/2437732588\\" title=\\"View 'Post Article' on Flickr.com\\"><img alt=\\"Post Article\\" border=\\"0\\" src=\\"http://static.flickr.com/2233/2437732588_320a56291f.jpg\\" width=\\"467\\" /></a></div>", "category": [2], "read_count": 3, "description": "Recipe for creating a painterly effect on your photographs.", "title": "Painterly Portrait Processing", "related_content": [2], "markup": "textile", "tags": "photography, photoshop, aperture", "excerpt": "<p>Since posting this picture of my son Brodey on Flickr many months ago, I have received a lot of emails asking how I did the post work. Many people think it&rsquo;s <span class=\\"caps\\">HDR</span>, some say it&rsquo;s got the Dave Hill feel to it.</p>\\r\\n<div style=\\"text-align: center;\\"><a href=\\"http://www.flickr.com/photos/busyashell/1640623186/\\" title=\\"Attitude Reprocessed by greg.newman, on Flickr\\"><img alt=\\"Attitude Reprocessed\\" height=\\"500\\" src=\\"http://farm3.static.flickr.com/2274/1640623186_af11bde4cb.jpg\\" width=\\"335\\" /></a></div>\\r\\n<p>I will go through my recipe in detail. It&rsquo;s not a hard process. It&rsquo;s something I&rsquo;ve refined to work for me and over time, it&rsquo;s become second nature. I have even <a href=\\"http://www.flickr.com/photos/busyashell/2043426780/in/set-72157603247825297/\\">used it on landscapes</a> with great success. A lot of this works better with higher contrast images and good lighting (not that I&rsquo;m great at lighting).</p>", "publish_on": null, "blog": [1], "created_on": "2010-01-03 08:34:26", "published": true, "keywords": "photography, post-processing, photoshop, aperture, painterly, effects, sharpening", "updated_on": "2011-10-27 06:32:24", "expire_on": null, "slug": "painterly-portrait-processing"}}]	Painterly Portrait Processing	1	1
